6-6306 (Medium)\n	The certificate parser in OpenSSL before 1.0.1u and 1.0.2 before 1.0.2i might allow remote attackers to cause a denial of service (out-of-bounds read) via crafted certificate operations, related to s3_clnt.c and s3_srvr.c.\n\n	Package:       openssl @ 1.0.2g-1ubuntu4.1\n	Fixed version: 1.0.2g-1ubuntu4.4\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-6306\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-8622 (Medium)\n	URL unescape heap overflow via integer truncation\n\n	Package:       curl @ 7.47.0-1ubuntu2\n	Fixed version: 7.47.0-1ubuntu2.2\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-8622\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-8615 (Medium)\n	cookie injection for other servers\n\n	Package:       curl @ 7.47.0-1ubuntu2\n	Fixed version: 7.47.0-1ubuntu2.2\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-8615\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-6263 (Medium)\n	The stringprep_utf8_nfkc_normalize function in lib/nfkc.c in libidn before 1.33 allows context-dependent attackers to cause a denial of service (out-of-bounds read and crash) via crafted UTF-8 data.\n\n	Package:       libidn @ 1.32-3ubuntu1\n	Fixed version: 1.32-3ubuntu1.1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-6263\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2015-8631 (Medium)\n	Multiple memory leaks in kadmin/server/server_stubs.c in kadmind in MIT Kerberos 5 (aka krb5) before 1.13.4 and 1.14.x before 1.14.1 allow remote authenticated users to cause a denial of service (memory consumption) via a request specifying a NULL principal name.\n\n	Package:       krb5 @ 1.13.2+dfsg-5\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2015-8631\n	Layer