l @ 7.47.0-1ubuntu2\n	Fixed version: 7.47.0-1ubuntu2.2\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-7167\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-2183 (Low)\n	The DES and Triple DES ciphers, as used in the TLS, SSH, and IPSec protocols and other protocols and products, have a birthday bound of approximately four billion blocks, which makes it easier for remote attackers to obtain cleartext data via a birthday attack against a long-duration encrypted session, as demonstrated by an HTTPS session using Triple DES in CBC mode, aka a \"Sweet32\" attack.\n\n	Package:       gnutls28 @ 3.4.10-4ubuntu1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-2183\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2013-4235 (Low)\n	TOCTOU race conditions by copying and removing directory trees\n\n	Package:       shadow @ 1:4.2-3.1ubuntu5\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2013-4235\n	Layer:         sha256:31baf3c5ae52d3de62e0fc37996a1559a6afa194701e7b78f6323bb8d0d42da5\n\nCVE-2016-7444 (Low)\n	The gnutls_ocsp_resp_check_crt function in lib/x509/ocsp.c in GnuTLS before 3.4.15 and 3.5.x before 3.5.4 does not verify the serial length of an OCSP response, which might allow remote attackers to bypass an intended certificate validation mechanism via vectors involving trailing bytes left by gnutls_malloc.\n\n	Package:       gnutls28 @ 3.4.10-4ubuntu1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-7444\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-6302 (Low)\n	The tls_decrypt_ticket function in ssl/t1_lib.c in OpenSSL before 1.1.0 does not consider the HMAC size during validation of the ticket length, which allows remote attackers to cause a denial of service via a ticket that is too short.\n\n	Package:       openssl @ 1.0.2g-1ubuntu4.1\n	Fixed version: 1.0.2g-1ubuntu4.4\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-6302\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2015-5180 (Low)\n	DNS resolver NULL pointer dereference with crafted record type\n\n	Package:       glibc @ 2.23-0ubuntu3\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2015-5180\n	Layer:         sha256:31baf3c5ae52d3de62e0fc37996a1559a6afa194701e7b78f6323bb8d0d42da5\n\nCVE-2016-5011 (Low)\n	Extended partition loop in MBR partition table leads to DoS\n\n	Package:       util-linux @ 2.27.1-6ubuntu3\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-5011\n	Layer:         sha256:31baf3c5ae52d3de62e0fc37996a1559a6afa194701e7b78f6323bb8d0d42da5\n\nCVE-2016-6323 (Low)\n	The makecontext function in the GNU C Library (aka glibc or libc6) before 2.25 creates execution contexts incompatible with the unwinder on ARM EABI (32-bit) platforms, which might allow context-dependent attackers to cause a denial of service (hang), as demonstrated by applications compiled using gccgo, related to backtrace generation.\n\n	Package:       glibc @ 2.23-0ubuntu3\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-6323\n	Layer:         sha256:31baf3c5ae52d3de62e0fc37996a1559a6afa194701e7b78f6323bb8d0d42da5\n\n', '5', '1', '39.32832');
INSERT INTO `clair_result` VALUES ('14', 'k8s-deploy/lbc:0.8', 'admin', 'k8s-deploy', '4', '65', 'CVE-2016-6304 (High)\n	Multiple memory leaks in t1_lib.c in OpenSSL before 1.0.1u, 1.0.2 before 1.0.2i, and 1.1.0 before 1.1.0a allow remote attackers to cause a denial of service (memory consumption) via large OCSP Status Request extensions.\n\n	Package:       openssl @ 1.0.2g-1ubuntu4.1\n	Fixed version: 1.0.2g-1ubuntu4.4\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-6304\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-6313 (High)\n	The mixing functions in the random number generator in Libgcrypt before 1.5.6, 1.6.x before 1.6.6, and 1.7.x before 1.7.3 and GnuPG before 1.4.21 make it easier for attackers to obtain the values of 160 bits by leveraging knowledge of the previous 4640 bits.\n\n	Package:       libgcrypt20 @ 1.6.5-2\n	Fixed version: 1.6.5-2ubuntu0.2\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-6313\n	Layer:         sha256:31baf3c5ae52d3de62e0fc37996a1559a6afa194701e7b78f6323bb8d0d42da5\n\nCVE-2016-6313 (High)\n	The mixing functions in the random number generator in Libgcrypt before 1.5.6, 1.6.x before 1.6.6, and 1.7.x before 1.7.3 and GnuPG before 1.4.21 make it easier for attackers to obtain the values of 160 bits by leveraging knowledge of the previous 4640 bits.\n\n	Package:       gnupg @ 1.4.20-1ubuntu3\n	Fixed version: 1.4.20-1ubuntu3.1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-6313\n	Layer:         sha256:31baf3c5ae52d3de62e0fc37996a1559a6afa194701e7b78f6323bb8d0d42da5\n\nCVE-2016-1252 (High)\n	A man-in-the-middle attacker could circumvent the InRelease signature of a repository, leading to a malicious package being installed and, therefore, remote arbitrary code execution.\n\n	Package:       apt @ 1.2.10ubuntu1\n	Fixed version: 1.2.15ubuntu0.2\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-1252\n	Layer:         sha256:31baf3c5ae52d3de62e0fc37996a1559a6afa194701e7b78f6323bb8d0d42da5\n\nCVE-2016-5300 (Medium)\n	The XML parser in Expat does not use sufficient entropy for hash initialization, which allows context-dependent attackers to cause a denial of service (CPU consumption) via crafted identifiers in an XML document. NOTE: this vulnerability exists because of an incomplete fix for CVE-2012-0876.\n\n	Package:       expat @ 2.1.0-7\n	Fixed version: 2.1.0-7ubuntu0.16.04.2\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-5300\n	Layer:         sha256:31baf3c5ae52d3de62e0fc37996a1559a6afa194701e7b78f6323bb8d0d42da5\n\nCVE-2016-2781 (Medium)\n	nonpriv session can escape to the parent session by using the TIOCSTI ioctl\n\n	Package:       coreutils @ 8.25-2ubuntu2\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-2781\n	Layer:         sha256:31baf3c5ae52d3de62e0fc37996a1559a6afa194701e7b78f6323bb8d0d42da5\n\nCVE-2012-6702 (Medium)\n	Expat, when used in a parser that has not called XML_SetHashSalt or passed it a seed of 0, makes it easier for context-dependent attackers to defeat cryptographic protection mechanisms via vectors involving use of the srand function.\n\n	Package:       expat @ 2.1.0-7\n	Fixed version: 2.1.0-7ubuntu0.16.04.2\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2012-6702\n	Layer:         sha256:31baf3c5ae52d3de62e0fc37996a1559a6afa194701e7b78f6323bb8d0d42da5\n\nCVE-2016-9069 (Medium)\n	heap-use-after-free in nsINode::ReplaceOrInsertBefore\n\n	Package:       expat @ 2.1.0-7\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-9069\n	Layer:         sha256:31baf3c5ae52d3de62e0fc37996a1559a6afa194701e7b78f6323bb8d0d42da5\n\nCVE-2016-0718 (Medium)\n	Expat allows context-dependent attackers to cause a denial of service (crash) or possibly execute arbitrary code via a malformed input document, which triggers a buffer overflow.\n\n	Package:       expat @ 2.1.0-7\n	Fixed version: 2.1.0-7ubuntu0.16.04.1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-0718\n	Layer:         sha256:31baf3c5ae52d3de62e0fc37996a1559a6afa194701e7b78f6323bb8d0d42da5\n\nCVE-2016-5360 (Medium)\n	HAproxy 1.6.x before 1.6.6, when a deny comes from a reqdeny rule, allows remote attackers to cause a denial of service (uninitialized memory access and crash) or possibly have unspecified other impact via unknown vectors.\n\n	Package:       haproxy @ 1.6.3-1\n	Fixed version: 1.6.3-1ubuntu0.1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-5360\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-6489 (Medium)\n	RSA code is vulnerable to cache sharing related attacks\n\n	Package:       nettle @ 3.2-1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-6489\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-6321 (Medium)\n	Directory traversal vulnerability in the safer_name_suffix function in GNU tar 1.14 through 1.29 might allow remote attackers to bypass an intended protection mechanism and write to arbitrary files via vectors related to improper sanitization of the file_name parameter, aka POINTYFEATHER.\n\n	Package:       tar @ 1.28-2.1\n	Fixed version: 1.28-2.1ubuntu0.1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-6321\n	Layer:         sha256:31baf3c5ae52d3de62e0fc37996a1559a6afa194701e7b78f6323bb8d0d42da5\n\nCVE-2015-8630 (Medium)\n	The (1) kadm5_create_principal_3 and (2) kadm5_modify_principal functions in lib/kadm5/srv/svr_principal.c in kadmind in MIT Kerberos 5 (aka krb5) 1.12.x and 1.13.x before 1.13.4 and 1.14.x before 1.14.1 allow remote authenticated users to cause a denial of service (NULL pointer dereference and daemon crash) by specifying KADM5_POLICY with a NULL policy name.\n\n	Package:       krb5 @ 1.13.2+dfsg-5\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2015-8630\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-6303 (Medium)\n	Integer overflow in the MDC2_Update function in crypto/mdc2/mdc2dgst.c in OpenSSL before 1.1.0 allows remote attackers to cause a denial of service (out-of-bounds write and application crash) or possibly have unspecified other impact via unknown vectors.\n\n	Package:       openssl @ 1.0.2g-1ubuntu4.1\n	Fixed version: 1.0.2g-1ubuntu4.4\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-6303\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-8624 (Medium)\n	invalid URL parsing with \'#\'\n\n	Package:       curl @ 7.47.0-1ubuntu2\n	Fixed version: 7.47.0-1ubuntu2.2\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-8624\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-2217 (Medium)\n	Socat security advisory 7 - Created new 2048bit DH modulus\n\n	Package:       socat @ 1.7.3.1-1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-2217\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-6261 (Medium)\n	The idna_to_ascii_4i function in lib/idna.c in libidn before 1.33 allows context-dependent attackers to cause a denial of service (out-of-bounds read and crash) via 64 bytes of input.\n\n	Package:       libidn @ 1.32-3ubuntu1\n	Fixed version: 1.32-3ubuntu1.1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-6261\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-6263 (Medium)\n	The stringprep_utf8_nfkc_normalize function in lib/nfkc.c in libidn before 1.33 allows context-dependent attackers to cause a denial of service (out-of-bounds read and crash) via crafted UTF-8 data.\n\n	Package:       libidn @ 1.32-3ubuntu1\n	Fixed version: 1.32-3ubuntu1.1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-6263\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-6262 (Medium)\n	idn in libidn before 1.33 might allow remote attackers to obtain sensitive memory information by reading a zero byte as input, which triggers an out-of-bounds read, a different vulnerability than CVE-2015-8948.\n\n	Package:       libidn @ 1.32-3ubuntu1\n	Fixed version: 1.32-3ubuntu1.1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-6262\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-8618 (Medium)\n	double-free in curl_maprintf\n\n	Package:       curl @ 7.47.0-1ubuntu2\n	Fixed version: 7.47.0-1ubuntu2.2\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-8618\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-3119 (Medium)\n	The process_db_args function in plugins/kdb/ldap/libkdb_ldap/ldap_principal2.c in the LDAP KDB module in kadmind in MIT Kerberos 5 (aka krb5) through 1.13.4 and 1.14.x through 1.14.1 mishandles the DB argument, which allows remote authenticated users to cause a denial of service (NULL pointer dereference and daemon crash) via a crafted request to modify a principal.\n\n	Package:       krb5 @ 1.13.2+dfsg-5\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-3119\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-6306 (Medium)\n	The certificate parser in OpenSSL before 1.0.1u and 1.0.2 before 1.0.2i might allow remote attackers to cause a denial of service (out-of-bounds read) via crafted certificate operations, related to s3_clnt.c and s3_srvr.c.\n\n	Package:       openssl @ 1.0.2g-1ubuntu4.1\n	Fixed version: 1.0.2g-1ubuntu4.4\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-6306\n	Layer:         sha256:f981a92e812174c5