2e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-3706 (Low)\n	Stack-based buffer overflow in the getaddrinfo function in sysdeps/posix/getaddrinfo.c in the GNU C Library (aka glibc or libc6) allows remote attackers to cause a denial of service (crash) via vectors involving hostent conversion. NOTE: this vulnerability exists because of an incomplete fix for CVE-2013-4458.\n\n	Package:       glibc @ 2.23-0ubuntu3\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-3706\n	Layer:         sha256:31baf3c5ae52d3de62e0fc37996a1559a6afa194701e7b78f6323bb8d0d42da5\n\nCVE-2016-7141 (Low)\n	curl and libcurl before 7.50.2, when built with NSS and the libnsspem.so library is available at runtime, allow remote attackers to hijack the authentication of a TLS connection by leveraging reuse of a previously loaded client certificate from file for a connection for which no certificate has been set, a different vulnerability than CVE-2016-5420.\n\n	Package:       curl @ 7.47.0-1ubuntu2\n	Fixed version: 7.47.0-1ubuntu2.2\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-7141\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-7444 (Low)\n	The gnutls_ocsp_resp_check_crt function in lib/x509/ocsp.c in GnuTLS before 3.4.15 and 3.5.x before 3.5.4 does not verify the serial length of an OCSP response, which might allow remote attackers to bypass an intended certificate validation mechanism via vectors involving trailing bytes left by gnutls_malloc.\n\n	Package:       gnutls28 @ 3.4.10-4ubuntu1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-7444\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2013-4235 (Low)\n	TOCTOU race conditions by copying and removing directory trees\n\n	Package:       shadow @ 1:4.2-3.1ubuntu5\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2013-4235\n	Layer:         sha256:31baf3c5ae52d3de62e0fc37996a1559a6afa194701e7b78f6323bb8d0d42da5\n\nCVE-2016-2177 (Low)\n	OpenSSL through 1.0.2h incorrectly uses pointer arithmetic for heap-buffer boundary checks, which might allow remote attackers to cause a denial of service (integer overflow and application crash) or possibly have unspecified other impact by leveraging unexpected malloc behavior, related to s3_srvr.c, ssl_sess.c, and t1_lib.c.\n\n	Package:       openssl @ 1.0.2g-1ubuntu4.1\n	Fixed version: 1.0.2g-1ubuntu4.4\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-2177\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\nCVE-2016-3189 (Low)\n	Use-after-free vulnerability in bzip2recover in bzip2 1.0.6 allows remote attackers to cause a denial of service (crash) via a crafted bzip2 file, related to block ends set to before the start of the block.\n\n	Package:       bzip2 @ 1.0.6-8\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-3189\n	Layer:         sha256:31baf3c5ae52d3de62e0fc37996a1559a6afa194701e7b78f6323bb8d0d42da5\n\nCVE-2016-8625 (Low)\n	IDNA 2003 makes curl use wrong host\n\n	Package:       curl @ 7.47.0-1ubuntu2\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-8625\n	Layer:         sha256:f981a92e812174c53d0ee2769ffbade03207f981f83fe82ee562b3b411e614e7\n\n', '5', '1', '39.96497');
INSERT INTO `clair_result` VALUES ('15', 'k8s-deploy/kapacitor:0.13.1', 'admin', 'k8s-deploy', '2', '35', 'CVE-2016-7167 (High)\n	Multiple integer overflows in the (1) curl_escape, (2) curl_easy_escape, (3) curl_unescape, and (4) curl_easy_unescape functions in libcurl before 7.50.3 allow attackers to have unspecified impact via a string of length 0xffffffff, which triggers a heap-based buffer overflow.\n\n	Package:       curl @ 7.38.0-4+deb8u5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-7167\n	Layer:         sha256:0bc550005600ca95744b9af630448dbafb9284c312d39f08dd910b244373357c\n\nCVE-2014-9761 (High)\n	Multiple stack-based buffer overflows in the GNU C Library (aka glibc or libc6) before 2.23 allow context-dependent attackers to cause a denial of service (application crash) or possibly execute arbitrary code via a long argument to the (1) nan, (2) nanf, or (3) nanl function.\n\n	Package:       glibc @ 2.19-18+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2014-9761\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2015-3217 (Medium)\n	PCRE 7.8 and 8.32 through 8.37, and PCRE2 10.10 mishandle group empty matches, which might allow remote attackers to cause a denial of service (stack-based buffer overflow) via a crafted regular expression, as demonstrated by /^(?:(?(1)\\\\.|([^\\\\\\\\W_])?)+)+$/.\n\n	Package:       pcre3 @ 2:8.35-3.3+deb8u4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-3217\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2016-3120 (Medium)\n	The validate_as_request function in kdc_util.c in the Key Distribution Center (KDC) in MIT Kerberos 5 (aka krb5) before 1.13.6 and 1.4.x before 1.14.3, when restrict_anonymous_to_tgt is enabled, uses an incorrect client data structure, which allows remote authenticated users to cause a denial of service (NULL pointer dereference and daemon crash) via an S4U2Self request.\n\n	Package:       krb5 @ 1.12.1+dfsg-19+deb8u2\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3120\n	Layer:         sha256:0bc550005600ca95744b9af630448dbafb9284c312d39f08dd910b244373357c\n\nCVE-2015-2694 (Medium)\n	The kdcpreauth modules in MIT Kerberos 5 (aka krb5) 1.12.x and 1.13.x before 1.13.2 do not properly track whether a client\'s request has been validated, which allows remote attackers to bypass an intended preauthentication requirement by providing (1) zero bytes of data or (2) an arbitrary realm name, related to plugins/preauth/otp/main.c and plugins/preauth/pkinit/pkinit_srv.c.\n\n	Package:       krb5 @ 1.12.1+dfsg-19+deb8u2\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-2694\n	Layer:         sha256:0bc550005600ca95744b9af630448dbafb9284c312d39f08dd910b244373357c\n\nCVE-2016-7796 (Medium)\n	The manager_dispatch_notify_fd function in systemd allows local users to cause a denial of service (system hang) via a zero-length message received over a notify socket, which causes an error to be returned and the notification handler to be disabled.\n\n	Package:       systemd @ 215-17+deb8u5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-7796\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2016-7141 (Medium)\n	curl and libcurl before 7.50.2, when built with NSS and the libnsspem.so library is available at runtime, allow remote attackers to hijack the authentication of a TLS connection by leveraging reuse of a previously loaded client certificate from file for a connection for which no certificate has been set, a different vulnerability than CVE-2016-5420.\n\n	Package:       curl @ 7.38.0-4+deb8u5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-7141\n	Layer:         sha256:0bc550005600ca95744b9af630448dbafb9284c312d39f08dd910b244373357c\n\nCVE-2016-7444 (Medium)\n	The gnutls_ocsp_resp_check_crt function in lib/x509/ocsp.c in GnuTLS before 3.4.15 and 3.5.x before 3.5.4 does not verify the serial length of an OCSP response, which might allow remote attackers to bypass an intended certificate validation mechanism via vectors involving trailing bytes left by gnutls_malloc.\n\n	Package:       gnutls28 @ 3.3.8-6+deb8u3\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-7444\n	Layer:         sha256:0bc550005600ca95744b9af630448dbafb9284c312d39f08dd910b244373357c\n\nCVE-2011-3389 (Medium)\n	The SSL protocol, as used in certain configurations in Microsoft Windows and Microsoft Internet Explorer, Mozilla Firefox, Google Chrome, Opera, and other products, encrypts data by using CBC mode with chained initialization vectors, which allows man-in-the-middle attackers to obtain plaintext HTTP headers via a blockwise chosen-boundary attack (BCBA) on an HTTPS session, in conjunction with JavaScript code that uses (1) the HTML5 WebSocket API, (2) the Java URLConnection API, or (3) the Silverlight WebClient API, aka a \"BEAST\" attack.\n\n	Package:       gnutls28 @ 3.3.8-6+deb8u3\n	Link:          https://security-tracker.debian.org/tracker/CVE-2011-3389\n	Layer:         sha256:0bc550005600ca95744b9af630448dbafb9284c312d39f08dd910b244373357c\n\nCVE-2015-5276 (Medium)\n	The std::random_device class in libstdc++ in the GNU Compiler Collection (aka GCC) before 4.9.4 does not properly handle short reads from blocking sources, which makes it easier for context-dependent attackers to predict the random values via unspecified vectors.\n\n	Package:       gcc-4.9 @ 4.9.2-10\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-5276\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2016-3189 (Low)\n	Use-after-free vulnerability in bzip2recover in bzip2 1.0.6 allows remote attackers to cause a denial of service (crash) via a crafted bzip2 file, related to block ends set to before the start of the block.\n\n	Package:       bzip2 @ 1.0.6-7\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3189\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2016-3119 (Low)\n	The process_db_args function in plugins/kdb/ldap/libkdb_ldap/ldap_principal2.c in the LDAP KDB module in kadmind in MIT Kerberos 5 (aka krb5) through 1.13.4 and 1.14.x through 1.14.1 mishandles the DB argument, which allows remote authenticated users to cause a denial of service (NULL pointer dereference and daemon crash) via a crafted request to modify a principal.\n\n	Package:       krb5 @ 1.12.1+dfsg-19+deb8u2\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3119\n	Layer:         sha256:0bc550005600ca95744b9af630448dbafb9284c312d39f08dd910b244373357c\n\nCVE-2015-5180 (Low)\n	Package:       glibc @ 2.19-18+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-5180\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2007-6755 (Negligible)\n	The NIST SP 800-90A default statement of the Dual Elliptic Curve Deterministic Random Bit Generation (Dual_EC_DRBG) algorithm contains point Q constants with a possible relationship to certain \"skeleton key\" values, which might allow context-dependent attackers to defeat cryptographic protection mechanisms by leveraging knowledge of those values.  NOTE: this is a preliminary CVE for Dual_EC_DRBG; future research may provide additional details about point Q and associated attacks, and could potentially lead to a RECAST or REJECT of this CVE.\n\n	Package:       openssl @ 1.0.1t-1+deb8u5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2007-6755\n	Layer:         sha256:0bc550005600ca95744b9af630448dbafb9284c312d39f08dd910b244373357c\n\nCVE-2016-4484 (Negligible)\n	Package:       cryptsetup @ 2:1.6.6-5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-4484\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2010-4756 (Negligible)\n	The glob implementation in the GNU C Library (aka glibc or libc6) allows remote authenticated users to cause a denial of service (CPU and memory consumption) via crafted glob expressions that do not match any pathnames, as demonstrated by glob expressions in STAT commands to an FTP daemon, a different vulnerability than CVE-2010-2632.\n\n	Package:       glibc @ 2.19-18+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2010-4756\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2016-6251 (Negligible)\n	Package:       shadow @ 1:4.2-3+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-6251\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2010-4052 (Negligible)\n	Stack consumption vulnerability in the regcomp implementation in the GNU C Library (aka glibc or libc6) through 2.11.3, and 2.12.x through 2.12.2, allows context-dependent attackers to cause a denial of service (resource exhaustion) via a regular expression containing adjacent repetition operators, as demonstrated by a {10,}{10,}{10,}{10,} sequence in the proftpd.gnu.c exploit for ProFTPD.\n\n	Package:       glibc @ 2.19-18+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2010-4052\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2016-6252 (Negligible)\n	Package:       shadow @ 1:4.2-3+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-6252\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2012-3878 (Negligible)\n	Package:       perl @ 5.20.2-3+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2012-3878\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2015-3276 (Negligible)\n	The nss_parse_ciphers function in libraries/libldap/tls_m.c in OpenLDAP does not properly parse OpenSSL-style multi-keyword mode cipher strings, which might cause a weaker than intended cipher to be used and allow remote attackers to have unspecified impact via unknown vectors.\n\n	Package:       openldap @ 2.4.40+dfsg-1+deb8u2\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-3276\n	Layer:         sha256:0bc550005600ca95744b9af630448dbafb9284c312d39f08dd910b244373357c\n\nCVE-2013-4235 (Negligible)\n	Package:       shadow @ 1:4.2-3+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2013-4235\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2010-0928 (Negligible)\n	OpenSSL 0.9.8i on the Gaisler Research LEON3 SoC on the Xilinx Virtex-II Pro FPGA uses a Fixed Width Exponentiation (FWE) algorithm for certain signature calculations, and does not verify the signature before providing it to a caller, which makes it easier for physically proximate attackers to determine the private key via a modified supply voltage for the microprocessor, related to a \"fault-based attack.\"\n\n	Package:       openssl @ 1.0.1t-1+deb8u5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2010-0928\n	Layer:         sha256:0bc550005600ca95744b9af630448dbafb9284c312d39f08dd910b244373357c\n\nCVE-2007-5686 (Negligible)\n	initscripts in rPath Linux 1 sets insecure permissions for the /var/log/btmp file, which allows local users to obtain sensitive information regarding authentication attempts.  NOTE: because sshd detects the insecure permissions and does not log certain events, this also prevents sshd from logging failed authentication attempts by remote attackers.\n\n	Package:       shadow @ 1:4.2-3+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2007-5686\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2015-5218 (Negligible)\n	Buffer overflow in text-utils/colcrt.c in colcrt in util-linux before 2.27 allows local users to cause a denial of service (crash) via a crafted file, related to the page global variable.\n\n	Package:       util-linux @ 2.25.2-6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-5218\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2015-5224 (Negligible)\n	Package:       util-linux @ 2.25.2-6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-5224\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2016-0634 (Negligible)\n	Package:       bash @ 4.3-11\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-0634\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2004-0971 (Negligible)\n	The krb5-send-pr script in the kerberos5 (krb5) package in Trustix Secure Linux 1.5 through 2.1, and possibly other operating systems, allows local users to overwrite files via a symlink attack on temporary files.\n\n	Package:       krb5 @ 1.12.1+dfsg-19+deb8u2\n	Link:          https://security-tracker.debian.org/tracker/CVE-2004-0971\n	Layer:         sha256:0bc550005600ca95744b9af630448dbafb9284c312d39f08dd910b244373357c\n\nCVE-2016-2779 (Negligible)\n	Package:       util-linux @ 2.25.2-6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-2779\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2011-4116 (Negligible)\n	Package:       perl @ 5.20.2-3+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2011-4116\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2016-1252 (Negligible)\n	Package:       apt @ 1.0.9.8.3\n	Fixed version: 1.0.9.8.4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-1252\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2010-4051 (Negligible)\n	The regcomp implementation in the GNU C Library (aka glibc or libc6) through 2.11.3, and 2.12.x through 2.12.2, allows context-dependent attackers to cause a denial of service (application crash) via a regular expression containing adjacent bounded repetitions that bypass the intended RE_DUP_MAX limitation, as demonstrated by a {10,}{10,}{10,}{10,}{10,} sequence in the proftpd.gnu.c exploit for ProFTPD, related to a \"RE_DUP_MAX overflow.\"\n\n	Package:       glibc @ 2.19-18+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2010-4051\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2011-3374 (Negligible)\n	Package:       apt @ 1.0.9.8.3\n	Link:          https://security-tracker.debian.org/tracker/CVE-2011-3374\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2016-3739 (Negligible)\n	The (1) mbed_connect_step1 function in lib/vtls/mbedtls.c and (2) polarssl_connect_step1 function in lib/vtls/polarssl.c in cURL and libcurl before 7.49.0, when using SSLv3 or making a TLS connection to a URL that uses a numerical IP address, allow remote attackers to spoof servers via an arbitrary valid certificate.\n\n	Package:       curl @ 7.38.0-4+deb8u5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3739\n	Layer:         sha256:0bc550005600ca95744b9af630448dbafb9284c312d39f08dd910b244373357c\n\nCVE-2013-4392 (Negligible)\n	systemd, when updating file permissions, allows local users to change the permissions and SELinux security contexts for arbitrary files via a symlink attack on unspecified files.\n\n	Package:       systemd @ 215-17+deb8u5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2013-4392\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2015-5186 (Negligible)\n	Package:       audit @ 1:2.4-1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-5186\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\nCVE-2005-2541 (Negligible)\n	Tar 1.15.1 does not properly warn the user when extracting setuid or setgid files, which may allow local users or remote attackers to gain privileges.\n\n	Package:       tar @ 1.27.1-2+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2005-2541\n	Layer:         sha256:1fad42e8a0d9781677d366b1100defcadbe653280300cf62a23e07eb5e9d3a41\n\n', '5', '1', '70.06055');
INSERT INTO `clair_result` VALUES ('16', 'k8s-deploy/nfs-server:1.2', 'admin', 'k8s-deploy', '0', '0', 'RHSA-2016:1025 (High)\n	PCRE is a Perl-compatible regular expression library. Security Fix(es): * Multiple flaws were found in the way PCRE handled malformed regular expressions. An attacker able to make an application using PCRE process a specially crafted regular expression could use these flaws to cause the application to crash or, possibly, execute arbitrary code. (CVE-2015-8385, CVE-2016-3191, CVE-2015-2328, CVE-2015-3217, CVE-2015-5073, CVE-2015-8388, CVE-2015-8391, CVE-2015-8386)\n\n	Package:       pcre @ 8.32-15.el7\n	Fixed version: 8.32-15.el7_2.1\n	Link:          https://rhn.redhat.com/errata/RHSA-2016-1025.html\n	Layer:         sha256:0d8b9c3d3b0d6f4483371f939f0b5ce9bc94838a6878250d92ef05f9207bc32c\n\nRHSA-2016:2615 (High)\n	The Berkeley Internet Name Domain (BIND) is an implementation of the Domain Name System (DNS) protocols. BIND includes a DNS server (named); a resolver library (routines for applications to use when interfacing with DNS); and tools for verifying that the DNS server is operating correctly. Security Fix(es): * A denial of service flaw was found in the way BIND handled responses containing a DNAME answer. A remote attacker could use this flaw to make named exit unexpectedly with an assertion failure via a specially crafted DNS response. (CVE-2016-8864) Red Hat would like to thank ISC for reporting this issue. Upstream acknowledges Tony Finch (University of Cambridge) and Marco Davids (SIDN Labs) as the original reporters.\n\n	Package:       bind-license @ 32:9.9.4-29.el7_2.2\n	Fixed version: 32:9.9.4-38.el7_3\n	Link:          https://rhn.redhat.com/errata/RHSA-2016-2615.html\n	Layer:         sha256:0d8b9c3d3b0d6f4483371f939f0b5ce9bc94838a6878250d92ef05f9207bc32c\n\nRHSA-2016:0722 (High)\n	OpenSSL is a toolkit that implements the Secure Sockets Layer (SSL) and Transport Layer Security (TLS) protocols, as well as a full-strength general-purpose cryptography library. Security Fix(es): * A flaw was found in the way OpenSSL encoded certain ASN.1 data structures. An attacker could use this flaw to create a specially crafted certificate which, when verified or re-encoded by OpenSSL, could cause it to crash, or execute arbitrary code using the permissions of the user running an application compiled against the OpenSSL library. (CVE-2016-2108) * Two integer overflow flaws, leading to buffer overflows, were found in the way the EVP_EncodeUpdate() and EVP_EncryptUpdate() functions of OpenSSL parsed very large amounts of input data. A remote attacker could use these flaws to crash an application using OpenSSL or, possibly, execute arbitrary code with the permissions of the user running that application. (CVE-2016-2105, CVE-2016-2106) * It was discovered that OpenSSL leaked timing information when decrypting TLS/SSL and DTLS protocol encrypted records when the connection used the AES CBC cipher suite and the server supported AES-NI. A remote attacker could possibly use this flaw to retrieve plain text from encrypted packets by using a TLS/SSL or DTLS server as a padding oracle. (CVE-2016-2107) * Several flaws were found in the way BIO_*printf functions were implemented in OpenSSL. Applications which passed large amounts of untrusted data through these functions could crash or potentially execute code with the permissions of the user running such an application. (CVE-2016-0799, CVE-2016-2842) * A denial of service flaw was found in the way OpenSSL parsed certain ASN.1-encoded data from BIO (OpenSSL\'s I/O abstraction) inputs. An application using OpenSSL that accepts untrusted ASN.1 BIO input could be forced to allocate an excessive amount of data. (CVE-2016-2109) Red Hat would like to thank the OpenSSL project for reporting CVE-2016-2108, CVE-2016-2842, CVE-2016-2105, CVE-2016-2106, CVE-2016-2107, and CVE-2016-0799. Upstream acknowledges Huzaifa Sidhpurwala (Red Hat), Hanno Böck, and David Benjamin (Google) as the original reporters of CVE-2016-2108; Guido Vranken as the original reporter of CVE-2016-2842, CVE-2016-2105, CVE-2016-2106, and CVE-2016-0799; and Juraj Somorovsky as the original reporter of CVE-2016-2107.\n\n	Package:       openssl-libs @ 1:1.0.1e-51.el7_2.4\n	Fixed version: 1:1.0.1e-51.el7_2.5\n	Link:          https://rhn.redhat.com/errata/RHSA-2016-0722.html\n	Layer:         sha256:0d8b9c3d3b0d6f4483371f939f0b5ce9bc94838a6878250d92ef05f9207bc32c\n\nRHSA-2016:1292 (High)\n	The libxml2 library is a development toolbox providing the implementation of various XML standards. Security Fix(es): A heap-based buffer overflow flaw was found in the way libxml2 parsed certain crafted XML input. A remote attacker could provide a specially crafted XML file that, when opened in an application linked against libxml2, would cause the application to crash or execute arbitrary code with the permissions of the user running the application. (CVE-2016-1834, CVE-2016-1840) Multiple denial of service flaws were found in libxml2. A remote attacker could provide a specially crafted XML file that, when processed by an application using libxml2, could cause that application to crash.  (CVE-2016-1762, CVE-2016-1833, CVE-2016-1835, CVE-2016-1836, CVE-2016-1837, CVE-2016-1838, CVE-2016-1839, CVE-2016-3627, CVE-2016-3705, CVE-2016-4447, CVE-2016-4448, CVE-2016-4449)\n\n	Package:       libxml2 @ 2.9.1-6.el7_2.2\n	Fixed version: 2.9.1-6.el7_2.3\n	Link:          https://access.redhat.com/errata/RHSA-2016:1292\n	Layer:         sha256:0d8b9c3d3b0d6f4483371f939f0b5ce9bc94838a6878250d92ef05f9207bc32c\n\nRHSA-2016:2575 (Medium)\n	The curl packages provide the libcurl library and the curl utility for downloading files from servers using various protocols, including HTTP, FTP, and LDAP. Security Fix(es): * It was found that the libcurl library did not prevent TLS session resumption when the client certificate had changed. An attacker could potentially use this flaw to hijack the authentication of the connection by leveraging a previously created connection with a different client certificate. (CVE-2016-5419) * It was found that the libcurl library did not check the client certificate when choosing the TLS connection to reuse. An attacker could potentially use this flaw to hijack the authentication of the connection by leveraging a previously created connection with a different client certificate. (CVE-2016-5420) * It was found that the libcurl library using the NSS (Network Security Services) library as TLS/SSL backend incorrectly re-used client certificates for subsequent TLS connections in certain cases. An attacker could potentially use this flaw to hijack the authentication of the connection by leveraging a previously created connection with a different client certificate. (CVE-2016-7141) Additional Changes: For detailed information on changes in this release, see the Red Hat Enterprise Linux 7.3 Release Notes linked from the References section.\n\n	Package:       libcurl @ 7.29.0-25.el7.centos\n	Fixed version: 7.29.0-35.el7\n	Link:          https://rhn.redhat.com/errata/RHSA-2016-2575.html\n	Layer:         sha256:0d8b9c3d3b0d6f4483371f939f0b5ce9bc94838a6878250d92ef05f9207bc32c\n\nRHSA-2016:2610 (Medium)\n	The systemd packages contain systemd, a system and service manager for Linux, compatible with the SysV and LSB init scripts. It provides aggressive parallelism capabilities, uses socket and D-Bus activation for starting services, offers on-demand starting of daemons, and keeps track of processes using Linux cgroups. In addition, it supports snapshotting and restoring of the system state, maintains mount and automount points, and implements an elaborate transactional dependency-based service control logic. It can also work as a drop-in replacement for sysvinit. Security Fix(es): * A flaw was found in the way systemd handled empty notification messages. A local attacker could use this flaw to make systemd freeze its execution, preventing further management of system services, system shutdown, or zombie process collection via systemd. (CVE-2016-7795) Bug Fix(es): * Previously, the udev device manager automatically enabled all memory banks on IBM z System installations. As a consequence, hot plug memory was enabled automatically, which was incorrect. With this update, system architecture checks have been added to the udev rules to address the problem. As a result, hot plug memory is no longer automatically enabled. (BZ#1381123)\n\n	Package:       systemd @ 219-19.el7_2.4\n	Fixed version: 219-30.el7_3.3\n	Link:          https://rhn.redhat.com/errata/RHSA-2016-2610.html\n	Layer:         sha256:0d8b9c3d3b0d6f4483371f939f0b5ce9bc94838a6878250d92ef05f9207bc32c\n\nRHSA-2016:2575 (Medium)\n	The curl packages provide the libcurl library and the curl utility for downloading files from servers using various protocols, including HTTP, FTP, and LDAP. Security Fix(es): * It was found that the libcurl library did not prevent TLS session resumption when the client certificate had changed. An attacker could potentially use this flaw to hijack the authentication of the connection by leveraging a previously created connection with a different client certificate. (CVE-2016-5419) * It was found that the libcurl library did not check the client certificate when choosing the TLS connection to reuse. An attacker could potentially use this flaw to hijack the authentication of the connection by leveraging a previously created connection with a different client certificate. (CVE-2016-5420) * It was found that the libcurl library using the NSS (Network Security Services) library as TLS/SSL backend incorrectly re-used client certificates for subsequent TLS connections in certain cases. An attacker could potentially use this flaw to hijack the authentication of the connection by leveraging a previously created connection with a different client certificate. (CVE-2016-7141) Additional Changes: For detailed information on changes in this release, see the Red Hat Enterprise Linux 7.3 Release Notes linked from the References section.\n\n	Package:       curl @ 7.29.0-25.el7.centos\n	Fixed version: 7.29.0-35.el7\n	Link:          https://rhn.redhat.com/errata/RHSA-2016-2575.html\n	Layer:         sha256:0d8b9c3d3b0d6f4483371f939f0b5ce9bc94838a6878250d92ef05f9207bc32c\n\nRHSA-2016:0532 (Medium)\n	Kerberos is a network authentication system, which can improve the security of your network by eliminating the insecure practice of sending passwords over the network in unencrypted form. It allows clients and servers to authenticate to each other with the help of a trusted third party, the Kerberos key distribution center (KDC). Security Fix(es): * A memory leak flaw was found in the krb5_unparse_name() function of the MIT Kerberos kadmind service. An authenticated attacker could repeatedly send specially crafted requests to the server, which could cause the server to consume large amounts of memory resources, ultimately leading to a denial of service due to memory exhaustion. (CVE-2015-8631) * An out-of-bounds read flaw was found in the kadmind service of MIT Kerberos. An authenticated attacker could send a maliciously crafted message to force kadmind to read beyond the end of allocated memory, and write the memory contents to the KDC database if the attacker has write permission, leading to information disclosure. (CVE-2015-8629) * A NULL pointer dereference flaw was found in the procedure used by the MIT Kerberos kadmind service to store policies: the kadm5_create_principal_3() and kadm5_modify_principal() function did not ensure that a policy was given when KADM5_POLICY was set. An authenticated attacker with permissions to modify the database could use this flaw to add or modify a principal with a policy set to NULL, causing the kadmind service to crash. (CVE-2015-8630) The CVE-2015-8631 issue was discovered by Simo Sorce of Red Hat.\n\n	Package:       krb5-libs @ 1.13.2-10.el7\n	Fixed version: 1.13.2-12.el7_2\n	Link:          https://rhn.redhat.com/errata/RHSA-2016-0532.html\n	Layer:         sha256:0d8b9c3d3b0d6f4483371f939f0b5ce9bc94838a6878250d92ef05f9207bc32c\n\nRHSA-2016:2610 (Medium)\n	The systemd packages contain systemd, a system and service manager for Linux, compatible with the SysV and LSB init scripts. It provides aggressive parallelism capabilities, uses socket and D-Bus activation for starting services, offers on-demand starting of daemons, and keeps track of processes using Linux cgroups. In addition, it supports snapshotting and restoring of the system state, maintains mount and automount points, and implements an elaborate transactional dependency-based service control logic. It can also work as a drop-in replacement for sysvinit. Security Fix(es): * A flaw was found in the way systemd handled empty notification messages. A local attacker could use this flaw to make systemd freeze its execution, preventing further management of system services, system shutdown, or zombie process collection via systemd. (CVE-2016-7795) Bug Fix(es): * Previously, the udev device manager automatically enabled all memory banks on IBM z System installations. As a consequence, hot plug memory was enabled automatically, which was incorrect. With this update, system architecture checks have been added to the udev rules to address the problem. As a result, hot plug memory is no longer automatically enabled. (BZ#1381123)\n\n	Package:       systemd-libs @ 219-19.el7_2.4\n	Fixed version: 219-30.el7_3.3\n	Link:          https://rhn.redhat.com/errata/RHSA-2016-2610.html\n	Layer:         sha256:0d8b9c3d3b0d6f4483371f939f0b5ce9bc94838a6878250d92ef05f9207bc32c\n\nRHSA-2016:2610 (Medium)\n	The systemd packages contain systemd, a system and service manager for Linux, compatible with the SysV and LSB init scripts. It provides aggressive parallelism capabilities, uses socket and D-Bus activation for starting services, offers on-demand starting of daemons, and keeps track of processes using Linux cgroups. In addition, it supports snapshotting and restoring of the system state, maintains mount and automount points, and implements an elaborate transactional dependency-based service control logic. It can also work as a drop-in replacement for sysvinit. Security Fix(es): * A flaw was found in the way systemd handled empty notification messages. A local attacker could use this flaw to make systemd freeze its execution, preventing further management of system services, system shutdown, or zombie process collection via systemd. (CVE-2016-7795) Bug Fix(es): * Previously, the udev device manager automatically enabled all memory banks on IBM z System installations. As a consequence, hot plug memory was enabled automatically, which was incorrect. With this update, system architecture checks have been added to the udev rules to address the problem. As a result, hot plug memory is no longer automatically enabled. (BZ#1381123)\n\n	Package:       systemd-sysv @ 219-19.el7_2.4\n	Fixed version: 219-30.el7_3.3\n	Link:          https://rhn.redhat.com/errata/RHSA-2016-2610.html\n	Layer:         sha256:e3ce617ef38f6cd0b015f863bd37597bc67b3ccd62f5d36234ac21096e0d23d6\n\nRHSA-2016:2824 (Medium)\n	Expat is a C library for parsing XML documents. Security Fix(es): * An out-of-bounds read flaw was found in the way Expat processed certain input. A remote attacker could send specially crafted XML that, when parsed by an application using the Expat library, would cause that application to crash or, possibly, execute arbitrary code with the permission of the user running the application. (CVE-2016-0718) Red Hat would like to thank Gustavo Grieco for reporting this issue.\n\n	Package:       expat @ 2.1.0-8.el7\n	Fixed version: 2.1.0-10.el7_3\n	Link:          https://rhn.redhat.com/errata/RHSA-2016-2824.html\n	Layer:         sha256:0d8b9c3d3b0d6f4483371f939f0b5ce9bc94838a6878250d92ef05f9207bc32c\n\n', '4', '1', '76.32394');
INSERT INTO `clair_result` VALUES ('17', 'k8s-deploy/nfs-pc:1.2.3', 'admin', 'k8s-deploy', '1', '23', 'CVE-2014-9761 (High)\n	Multiple stack-based buffer overflows in the GNU C Library (aka glibc or libc6) before 2.23 allow context-dependent attackers to cause a denial of service (application crash) or possibly execute arbitrary code via a long argument to the (1) nan, (2) nanf, or (3) nanl function.\n\n	Package:       glibc @ 2.19-18+deb8u7\n	Link:          https://security-tracker.debian.org/tracker/CVE-2014-9761\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2015-5276 (Medium)\n	The std::random_device class in libstdc++ in the GNU Compiler Collection (aka GCC) before 4.9.4 does not properly handle short reads from blocking sources, which makes it easier for context-dependent attackers to predict the random values via unspecified vectors.\n\n	Package:       gcc-4.9 @ 4.9.2-10\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-5276\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2016-7796 (Medium)\n	The manager_dispatch_notify_fd function in systemd allows local users to cause a denial of service (system hang) via a zero-length message received over a notify socket, which causes an error to be returned and the notification handler to be disabled.\n\n	Package:       systemd @ 215-17+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-7796\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2015-3217 (Medium)\n	PCRE 7.8 and 8.32 through 8.37, and PCRE2 10.10 mishandle group empty matches, which might allow remote attackers to cause a denial of service (stack-based buffer overflow) via a crafted regular expression, as demonstrated by /^(?:(?(1)\\\\.|([^\\\\\\\\W_])?)+)+$/.\n\n	Package:       pcre3 @ 2:8.35-3.3+deb8u4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-3217\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2016-3189 (Low)\n	Use-after-free vulnerability in bzip2recover in bzip2 1.0.6 allows remote attackers to cause a denial of service (crash) via a crafted bzip2 file, related to block ends set to before the start of the block.\n\n	Package:       bzip2 @ 1.0.6-7\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3189\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2015-5180 (Low)\n	Package:       glibc @ 2.19-18+deb8u7\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-5180\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2010-4051 (Negligible)\n	The regcomp implementation in the GNU C Library (aka glibc or libc6) through 2.11.3, and 2.12.x through 2.12.2, allows context-dependent attackers to cause a denial of service (application crash) via a regular expression containing adjacent bounded repetitions that bypass the intended RE_DUP_MAX limitation, as demonstrated by a {10,}{10,}{10,}{10,}{10,} sequence in the proftpd.gnu.c exploit for ProFTPD, related to a \"RE_DUP_MAX overflow.\"\n\n	Package:       glibc @ 2.19-18+deb8u7\n	Link:          https://security-tracker.debian.org/tracker/CVE-2010-4051\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2015-5218 (Negligible)\n	Buffer overflow in text-utils/colcrt.c in colcrt in util-linux before 2.27 allows local users to cause a denial of service (crash) via a crafted file, related to the page global variable.\n\n	Package:       util-linux @ 2.25.2-6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-5218\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2015-5186 (Negligible)\n	Package:       audit @ 1:2.4-1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-5186\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2012-3878 (Negligible)\n	Package:       perl @ 5.20.2-3+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2012-3878\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2011-4116 (Negligible)\n	Package:       perl @ 5.20.2-3+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2011-4116\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2016-6252 (Negligible)\n	Package:       shadow @ 1:4.2-3+deb8u3\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-6252\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2010-4052 (Negligible)\n	Stack consumption vulnerability in the regcomp implementation in the GNU C Library (aka glibc or libc6) through 2.11.3, and 2.12.x through 2.12.2, allows context-dependent attackers to cause a denial of service (resource exhaustion) via a regular expression containing adjacent repetition operators, as demonstrated by a {10,}{10,}{10,}{10,} sequence in the proftpd.gnu.c exploit for ProFTPD.\n\n	Package:       glibc @ 2.19-18+deb8u7\n	Link:          https://security-tracker.debian.org/tracker/CVE-2010-4052\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2016-2779 (Negligible)\n	Package:       util-linux @ 2.25.2-6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-2779\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2011-3374 (Negligible)\n	Package:       apt @ 1.0.9.8.4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2011-3374\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2007-5686 (Negligible)\n	initscripts in rPath Linux 1 sets insecure permissions for the /var/log/btmp file, which allows local users to obtain sensitive information regarding authentication attempts.  NOTE: because sshd detects the insecure permissions and does not log certain events, this also prevents sshd from logging failed authentication attempts by remote attackers.\n\n	Package:       shadow @ 1:4.2-3+deb8u3\n	Link:          https://security-tracker.debian.org/tracker/CVE-2007-5686\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2016-0634 (Negligible)\n	Package:       bash @ 4.3-11+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-0634\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2016-4484 (Negligible)\n	Package:       cryptsetup @ 2:1.6.6-5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-4484\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2013-4235 (Negligible)\n	Package:       shadow @ 1:4.2-3+deb8u3\n	Link:          https://security-tracker.debian.org/tracker/CVE-2013-4235\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2013-4392 (Negligible)\n	systemd, when updating file permissions, allows local users to change the permissions and SELinux security contexts for arbitrary files via a symlink attack on unspecified files.\n\n	Package:       systemd @ 215-17+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2013-4392\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2016-6251 (Negligible)\n	Package:       shadow @ 1:4.2-3+deb8u3\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-6251\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2005-2541 (Negligible)\n	Tar 1.15.1 does not properly warn the user when extracting setuid or setgid files, which may allow local users or remote attackers to gain privileges.\n\n	Package:       tar @ 1.27.1-2+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2005-2541\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2010-4756 (Negligible)\n	The glob implementation in the GNU C Library (aka glibc or libc6) allows remote authenticated users to cause a denial of service (CPU and memory consumption) via crafted glob expressions that do not match any pathnames, as demonstrated by glob expressions in STAT commands to an FTP daemon, a different vulnerability than CVE-2010-2632.\n\n	Package:       glibc @ 2.19-18+deb8u7\n	Link:          https://security-tracker.debian.org/tracker/CVE-2010-4756\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\nCVE-2015-5224 (Negligible)\n	Package:       util-linux @ 2.25.2-6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-5224\n	Layer:         sha256:6d827a3ef358f4fa21ef8251f95492e667da826653fd43641cef5a877dc03a70\n\n', '5', '1', '65.41784');
INSERT INTO `clair_result` VALUES ('18', 'k8s-deploy/influxdb:0.13', 'admin', 'k8s-deploy', '6', '39', 'CVE-2016-0494 (High)\n	Unspecified vulnerability in the Java SE and Java SE Embedded components in Oracle Java SE 6u105, 7u91, and 8u66 and Java SE Embedded 8u65 allows remote attackers to affect confidentiality, integrity, and availability via unknown vectors related to 2D.\n\n	Package:       icu @ 52.1-8+deb8u3\n	Fixed version: 52.1-8+deb8u4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-0494\n	Layer:         sha256:f49ebe34919a420f4e5bbb34069a12561dc5c9060796e85a592551b8304827fd\n\nCVE-2016-7415 (High)\n	Stack-based buffer overflow in the Locale class in common/locid.cpp in International Components for Unicode (ICU) through 57.1 for C/C++ allows remote attackers to cause a denial of service (application crash) or possibly have unspecified other impact via a long locale string.\n\n	Package:       icu @ 52.1-8+deb8u3\n	Fixed version: 52.1-8+deb8u4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-7415\n	Layer:         sha256:f49ebe34919a420f4e5bbb34069a12561dc5c9060796e85a592551b8304827fd\n\nCVE-2016-6293 (High)\n	The uloc_acceptLanguageFromHTTP function in common/uloc.cpp in International Components for Unicode (ICU) through 57.1 for C/C++ does not ensure that there is a \'\\0\' character at the end of a certain temporary array, which allows remote attackers to cause a denial of service (out-of-bounds read) or possibly have unspecified other impact via a call with a long httpAcceptLanguage argument.\n\n	Package:       icu @ 52.1-8+deb8u3\n	Fixed version: 52.1-8+deb8u4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-6293\n	Layer:         sha256:f49ebe34919a420f4e5bbb34069a12561dc5c9060796e85a592551b8304827fd\n\nCVE-2016-7167 (High)\n	Multiple integer overflows in the (1) curl_escape, (2) curl_easy_escape, (3) curl_unescape, and (4) curl_easy_unescape functions in libcurl before 7.50.3 allow attackers to have unspecified impact via a string of length 0xffffffff, which triggers a heap-based buffer overflow.\n\n	Package:       curl @ 7.38.0-4+deb8u4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-7167\n	Layer:         sha256:f49ebe34919a420f4e5bbb34069a12561dc5c9060796e85a592551b8304827fd\n\nCVE-2015-4844 (High)\n	Unspecified vulnerability in Oracle Java SE 6u101, 7u85, and 8u60, and Java SE Embedded 8u51, allows remote attackers to affect confidentiality, integrity, and availability via unknown vectors related to 2D.\n\n	Package:       icu @ 52.1-8+deb8u3\n	Fixed version: 52.1-8+deb8u4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-4844\n	Layer:         sha256:f49ebe34919a420f4e5bbb34069a12561dc5c9060796e85a592551b8304827fd\n\nCVE-2014-9761 (High)\n	Multiple stack-based buffer overflows in the GNU C Library (aka glibc or libc6) before 2.23 allow context-dependent attackers to cause a denial of service (application crash) or possibly execute arbitrary code via a long argument to the (1) nan, (2) nanf, or (3) nanl function.\n\n	Package:       glibc @ 2.19-18+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2014-9761\n	Layer:         sha256:9e1d18812a0db370ee386f0b57a68d452c84a21f3856b5e2162ffd8073afec54\n\nCVE-2011-3389 (Medium)\n	The SSL protocol, as used in certain configurations in Microsoft Windows and Microsoft Internet Explorer, Mozilla Firefox, Google Chrome, Opera, and other products, encrypts data by using CBC mode with chained initialization vectors, which allows man-in-the-middle attackers to obtain plaintext HTTP headers via a blockwise chosen-boundary attack (BCBA) on an HTTPS session, in conjunction with JavaScript code that uses (1) the HTML5 WebSocket API, (2) the Java URLConnection API, or (3) the Silverlight WebClient API, aka a \"BEAST\" attack.\n\n	Package:       gnutls28 @ 3.3.8-6+deb8u3\n	Link:          https://security-tracker.debian.org/tracker/CVE-2011-3389\n	Layer:         sha256:f49ebe34919a420f4e5bbb34069a12561dc5c9060796e85a592551b8304827fd\n\nCVE-2015-2694 (Medium)\n	The kdcpreauth modules in MIT Kerberos 5 (aka krb5) 1.12.x and 1.13.x before 1.13.2 do not properly track whether a client\'s request has been validated, which allows remote attackers to bypass an intended preauthentication requirement by providing (1) zero bytes of data or (2) an arbitrary realm name, related to plugins/preauth/otp/main.c and plugins/preauth/pkinit/pkinit_srv.c.\n\n	Package:       krb5 @ 1.12.1+dfsg-19+deb8u2\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-2694\n	Layer:         sha256:f49ebe34919a420f4e5bbb34069a12561dc5c9060796e85a592551b8304827fd\n\nCVE-2016-6321 (Medium)\n	Directory traversal vulnerability in the safer_name_suffix function in GNU tar 1.14 through 1.29 might allow remote attackers to bypass an intended protection mechanism and write to arbitrary files via vectors related to improper sanitization of the file_name parameter, aka POINTYFEATHER.\n\n	Package:       tar @ 1.27.1-2\n	Fixed version: 1.27.1-2+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-6321\n	Layer:         sha256:9e1d18812a0db370ee386f0b57a68d452c84a21f3856b5e2162ffd8073afec54\n\nCVE-2015-2632 (Medium)\n	Unspecified vulnerability in Oracle Java SE 6u95, 7u80, and 8u45 allows remote attackers to affect confidentiality via unknown vectors related to 2D.\n\n	Package:       icu @ 52.1-8+deb8u3\n	Fixed version: 52.1-8+deb8u4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-2632\n	Layer:         sha256:f49ebe34919a420f4e5bbb34069a12561dc5c9060796e85a592551b8304827fd\n\nCVE-2016-7141 (Medium)\n	curl and libcurl before 7.50.2, when built with NSS and the libnsspem.so library is available at runtime, allow remote attackers to hijack the authentication of a TLS connection by leveraging reuse of a previously loaded client certificate from file for a connection for which no certificate has been set, a different vulnerability than CVE-2016-5420.\n\n	Package:       curl @ 7.38.0-4+deb8u4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-7141\n	Layer:         sha256:f49ebe34919a420f4e5bbb34069a12561dc5c9060796e85a592551b8304827fd\n\nCVE-2015-3217 (Medium)\n	PCRE 7.8 and 8.32 through 8.37, and PCRE2 10.10 mishandle group empty matches, which might allow remote attackers to cause a denial of service (stack-based buffer overflow) via a crafted regular expression, as demonstrated by /^(?:(?(1)\\\\.|([^\\\\\\\\W_])?)+)+$/.\n\n	Package:       pcre3 @ 2:8.35-3.3+deb8u4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-3217\n	Layer:         sha256:9e1d18812a0db370ee386f0b57a68d452c84a21f3856b5e2162ffd8073afec54\n\nCVE-2016-3120 (Medium)\n	The validate_as_request function in kdc_util.c in the Key Distribution Center (KDC) in MIT Kerberos 5 (aka krb5) before 1.13.6 and 1.4.x before 1.14.3, when restrict_anonymous_to_tgt is enabled, uses an incorrect client data structure, which allows remote authenticated users to cause a denial of service (NULL pointer dereference and daemon crash) via an S4U2Self request.\n\n	Package:       krb5 @ 1.12.1+dfsg-19+deb8u2\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3120\n	Layer:         sha256:f49ebe34919a420f4e5bbb34069a12561dc5c9060796e85a592551b8304827fd\n\nCVE-2015-5276 (Medium)\n	The std::random_device class in libstdc++ in the GNU Compiler Collection (aka GCC) before 4.9.4 does not properly handle short reads from blocking sources, which makes it easier for context-dependent attackers to predict the random values via unspecified vectors.\n\n	Package:       gcc-4.9 @ 4.9.2-10\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-5276\n	Layer:         sha256:9e1d18812a0db370ee386f0b57a68d452c84a21f3856b5e2162ffd8073afec54\n\nCVE-2016-7796 (Medium)\n	The manager_dispatch_notify_fd function in systemd allows local users to cause a denial of service (system hang) via a zero-length message received over a notify socket, which causes an error to be returned and the notification handler to be disabled.\n\n	Package:       systemd @ 215-17+deb8u5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-7796\n	Layer:         sha256:9e1d18812a0db370ee386f0b57a68d452c84a21f3856b5e2162ffd8073afec54\n\nCVE-2016-7444 (Medium)\n	The gnutls_ocsp_resp_check_crt function in lib/x509/ocsp.c in GnuTLS before 3.4.15 and 3.5.x before 3.5.4 does not verify the serial length of an OCSP response, which might allow remote attackers to bypass an intended certificate validation mechanism via vectors involving trailing bytes left by gnutls_malloc.\n\n	Package:       gnutls28 @ 3.3.8-6+deb8u3\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-7444\n	Layer:         sha256:f49ebe34919a420f4e5bbb34069a12561dc5c9060796e85a592551b8304827fd\n\nCVE-2016-3119 (Low)\n	The process_db_args function in plugins/kdb/ldap/libkdb_ldap/ldap_principal2.c in the LDAP KDB module in kadmind in MIT Kerberos 5 (aka krb5) through 1.13.4 and 1.14.x through 1.14.1 mishandles the DB argument, which allows remote authenticated users to cause a denial of service (NULL pointer dereference and daemon crash) via a crafted request to modify a principal.\n\n	Package:       krb5 @ 1.12.1+dfsg-19+deb8u2\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3119\n	Layer:         sha256:f49ebe34919a420f4e5bbb34069a12561dc5c9060796e85a592551b8304827fd\n\nCVE-2016-7098 (Low)\n	Race condition in wget 1.17 and earlier, when used in recursive or mirroring mode to download a single file, might allow remote servers to bypass intended access list restrictions by keeping an HTTP connection open.\n\n	Package:       wget @ 1.16-1+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-7098\n	Layer:         sha256:f49ebe34919a420f4e5bbb34069a12561dc5c9060796e85a592551b8304827fd\n\nCVE-2015-5180 (Low)\n	Package:       glibc @ 2.19-18+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-5180\n	Layer:         sha256:9e1d18812a0db370ee386f0b57a68d452c84a21f3856b5e2162ffd8073afec54\n\nCVE-2016-3189 (Low)\n	Use-after-free vulnerability in bzip2recover in bzip2 1.0.6 allows remote attackers to cause a denial of service (crash) via a crafted bzip2 file, related to block ends set to before the start of the block.\n\n	Package:       bzip2 @ 1.0.6-7\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3189\n	Layer:         sha256:9e1d18812a0db370ee386f0b57a68d452c84a21f3856b5e2162ffd8073afec54\n\nCVE-2010-4052 (Negligible)\n	Stack consumption vulnerability in the regcomp implementation in the GNU C Library (aka glibc or libc6) through 2.11.3, and 2.12.x through 2.12.2, allows context-dependent attackers to cause a denial of service (resource exhaustion) via a regular expression containing adjacent repetition operators, as demonstrated by a {10,}{10,}{10,}{10,} sequence in the proftpd.gnu.c exploit for ProFTPD.\n\n	Package:       glibc @ 2.19-18+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2010-4052\n	Layer:         sha256:9e1d18812a0db370ee386f0b57a68d452c84a21f3856b5e2162ffd8073afec54\n\nCVE-2016-6251 (Negligible)\n	Package:       shadow @ 1:4.2-3+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-6251\n	Layer:         sha256:9e1d18812a0db370ee386f0b57a68d452c84a21f3856b5e2162ffd8073afec54\n\nCVE-2010-4051 (Negligible)\n	The regcomp implementation in the GNU C Library (aka glibc or libc6) through 2.11.3, and 2.12.x through 2.12.2, allows context-dependent attackers to cause a denial of service (application crash) via a regular expression containing adjacent bounded repetitions that bypass the intended RE_DUP_MAX limitation, as demonstrated by a {10,}{10,}{10,}{10,}{10,} sequence in the proftpd.gnu.c exploit for ProFTPD, related to a \"RE_DUP_MAX overflow.\"\n\n	Package:       glibc @ 2.19-18+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2010-4051\n	Layer:         sha256:9e1d18812a0db370ee386f0b57a68d452c84a21f3856b5e2162ffd8073afec54\n\nCVE-2016-3739 (Negligible)\n	The (1) mbed_connect_step1 function in lib/vtls/mbedtls.c and (2) polarssl_connect_step1 function in lib/vtls/polarssl.c in cURL and libcurl before 7.49.0, when using SSLv3 or making a TLS connection to a URL that uses a numerical IP address, allow remote attackers to spoof servers via an arbitrary valid certificate.\n\n	Package:       curl @ 7.38.0-4+deb8u4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3739\n	Layer:         sha256:f49ebe34919a420f4e5bbb34069a12561dc5c9060796e85a592551b8304827fd\n\nCVE-2007-6755 (Negligible)\n	The NIST SP 800-90A default statement of the Dual Elliptic Curve Deterministic Random Bit Generation (Dual_EC_DRBG) algorithm contains point Q constants with a possible relationship to certain \"skeleton key\" values, which might allow context-dependent attackers to defeat cryptographic protection mechanisms by leveraging knowledge of those values.  NOTE: this is a preliminary CVE for Dual_EC_DRBG; future research may provide additional details about point Q and associated attacks, and could potentially lead to a RECAST or REJECT of this CVE.\n\n	Package:       openssl @ 1.0.1t-1+deb8u5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2007-6755\n	Layer:         sha256:f49ebe34919a420f4e5bbb34069a12561dc5c9060796e85a592551b8304827fd\n\nCVE-2016-6252 (Negligible)\n	Package:       shadow @ 1:4.2-3+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-6252\n	Layer:         sha256:9e1d18812a0db370ee386f0b57a68d452c84a21f3856b5e2162ffd8073afec54\n\nCVE-2010-0928 (Negligible)\n	OpenSSL 0.9.8i on the Gaisler Research LEON3 SoC on the Xilinx Virtex-II Pro FPGA uses a Fixed Width Exponentiation (FWE) algorithm for certain signature calculations, and does not verify the signature before providing it to a caller, which makes it easier for physically proximate attackers to determine the private key via a modified supply voltage for the microprocessor, related to a \"fault-based attack.\"\n\n	Package:       openssl @ 1.0.1t-1+deb8u5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2010-0928\n	Layer:         sha256:f49ebe34919a420f4e5bbb34069a12561dc5c9060796e85a592551b8304827fd\n\nCVE-2015-5186 (Negligible)\n	Package:       audit @ 1:2.4-1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-5186\n	Layer:         sha256:9e1d18812a0db370ee386f0b57a68d452c84a21f3856b5e2162ffd8073afec54\n\nCVE-2013-4392 (Negligible)\n	systemd, when updating file permissions, allows local users to change the permissions and SELinux security contexts for arbitrary files via a symlink attack on unspecified files.\n\n	Package:       systemd @ 215-17+deb8u5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2013-4392\n	Layer:         sha256:9e1d18812a0db370ee386f0b57a68d452c84a21f3856b5e2162ffd8073afec54\n\nCVE-2005-2541 (Negligible)\n	Tar 1.15.1 does not properly warn the user when extracting setuid or setgid files, which may allow local users or remote attackers to gain privileges.\n\n	Package:       tar @ 1.27.1-2\n	Link:          https://security-tracker.debian.org/tracker/CVE-2005-2541\n	Layer:         sha256:9e1d18812a0db370ee386f0b57a68d452c84a21f3856b5e2162ffd8073afec54\n\nCVE-2013-4235 (Negligible)\n	Package:       shadow @ 1:4.2-3+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2013-4235\n	Layer:         sha256:9e1d18812a0db370ee386f0b57a68d452c84a21f3856b5e2162ffd8073afec54\n\nCVE-2015-3276 (Negligible)\n	The nss_parse_ciphers function in libraries/libldap/tls_m.c in OpenLDAP does not properly parse OpenSSL-style multi-keyword mode cipher strings, which might cause a weaker than intended cipher to be used and allow remote attackers to have unspecified impact via unknown vectors.\n\n	Package:       openldap @ 2.4.40+dfsg-1+d