ing information disclosure and DDoS amplification, and unset ntpd traps, disabling legitimate monitoring. A remote, unauthenticated, network attacker can trigger this vulnerability.\n\n	Package:       ntp @ 1:4.2.6.p5+dfsg-3ubuntu2.14.04.10\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-9310\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-7076 (Medium)\n	noexec bypass via wordexp()\n\n	Package:       sudo @ 1.8.9p5-1ubuntu1.4\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-7076\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2015-5602 (Medium)\n	sudoedit in Sudo before 1.8.15 allows local users to gain privileges via a symlink attack on a file whose full path is defined using multiple wildcards in /etc/sudoers, as demonstrated by \"/home/*/*/file.txt.\"\n\n	Package:       sudo @ 1.8.9p5-1ubuntu1.4\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2015-5602\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-7429 (Medium)\n	When ntpd receives a server response on a socket that corresponds to a different interface than was used for the request, the peer structure is updated to use the interface for new requests. If ntpd is running on a host with multiple interfaces in separate networks and the operating system doesn\'t check source address in received packets (e.g. rp_filter on Linux is set to 0), an attacker that knows the address of the source can send a packet with spoofed source address which will cause ntpd to select wrong interface for the source and prevent it from sending new requests until the list of interfaces is refreshed\n\n	Package:       ntp @ 1:4.2.6.p5+dfsg-3ubuntu2.14.04.10\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-7429\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2011-5325 (Medium)\n	path traversal vulnerability in busybox tar\n\n	Package:       busybox @ 1:1.21.0-1ubuntu1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2011-5325\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2015-8865 (Medium)\n	The file_check_mem function in funcs.c in file before 5.23, as used in the Fileinfo component in PHP before 5.5.34, 5.6.x before 5.6.20, and 7.x before 7.0.5, mishandles continuation-level jumps, which allows context-dependent attackers to cause a denial of service (buffer overflow and application crash) or possibly execute arbitrary code via a crafted magic file.\n\n	Package:       file @ 1:5.14-2ubuntu3.3\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2015-8865\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-2781 (Medium)\n	nonpriv session can escape to the parent session by using the TIOCSTI ioctl\n\n	Package:       coreutils @ 8.21-1ubuntu5.4\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-2781\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-8610 (Low)\n	Certain warning alerts are ignored if they are received. This can mean that no progress will be made if one peer continually sends those warning alerts.\n\n	Package:       openssl @ 1.0.1f-1ubuntu2.22\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-8610\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-7055 (Low)\n	Montgomery multiplication may produce incorrect results\n\n	Package:       openssl @ 1.0.1f-1ubuntu2.22\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-7055\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-2177 (Low)\n	OpenSSL through 1.0.2h incorrectly uses pointer arithmetic for heap-buffer boundary checks, which might allow remote attackers to cause a denial of service (integer overflow and application crash) or possibly have unspecified other impact by leveraging unexpected malloc behavior, related to s3_srvr.c, ssl_sess.c, and t1_lib.c.\n\n	Package:       openssl @ 1.0.1f-1ubuntu2.22\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-2177\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-2148 (Low)\n	heap overflow in OPTION_6RD parsing\n\n	Package:       busybox @ 1:1.21.0-1ubuntu1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-2148\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-3189 (Low)\n	Use-after-free vulnerability in bzip2recover in bzip2 1.0.6 allows remote attackers to cause a denial of service (crash) via a crafted bzip2 file, related to block ends set to before the start of the block.\n\n	Package:       bzip2 @ 1.0.6-5\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-3189\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2014-9645 (Low)\n	modprobe wrongly accepts paths as module names\n\n	Package:       busybox @ 1:1.21.0-1ubuntu1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2014-9645\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-5011 (Low)\n	Extended partition loop in MBR partition table leads to DoS\n\n	Package:       util-linux @ 2.20.1-5.1ubuntu20.9\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-5011\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2013-0157 (Low)\n	(a) mount and (b) umount in util-linux 2.14.1, 2.17.2, and probably other versions allow local users to determine the existence of restricted directories by (1) using the --guess-fstype command-line option or (2) attempting to mount a non-existent device, which generates different error messages depending on whether the directory exists.\n\n	Package:       util-linux @ 2.20.1-5.1ubuntu20.9\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2013-0157\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2014-9114 (Low)\n	blkid command injection\n\n	Package:       util-linux @ 2.20.1-5.1ubuntu20.9\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2014-9114\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2014-8625 (Low)\n	Multiple format string vulnerabilities in the parse_error_msg function in parsehelp.c in dpkg before 1.17.22 allow remote attackers to cause a denial of service (crash) and possibly execute arbitrary code via format string specifiers in the (1) package or (2) architecture name.\n\n	Package:       dpkg @ 1.17.5ubuntu5.7\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2014-8625\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2014-2667 (Low)\n	Race condition in the _get_masked_mode function in Lib/os.py in Python 3.2 through 3.5, when exist_ok is set to true and multiple threads are used, might allow local users to bypass intended file permissions by leveraging a separate application vulnerability before the umask has been set to the expected value.\n\n	Package:       python3.4 @ 3.4.3-1ubuntu1~14.04.5\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2014-2667\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-2147 (Low)\n	OOB heap write due to integer underflow\n\n	Package:       busybox @ 1:1.21.0-1ubuntu1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-2147\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2014-9653 (Low)\n	readelf.c in file before 5.22, as used in the Fileinfo component in PHP before 5.4.37, 5.5.x before 5.5.21, and 5.6.x before 5.6.5, does not consider that pread calls sometimes read only a subset of the available data, which allows remote attackers to cause a denial of service (uninitialized memory access) or possibly have unspecified other impact via a crafted ELF file.\n\n	Package:       file @ 1:5.14-2ubuntu3.3\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2014-9653\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2014-9620 (Low)\n	The ELF parser in file 5.08 through 5.21 allows remote attackers to cause a denial of service via a large number of notes.\n\n	Package:       file @ 1:5.14-2ubuntu3.3\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2014-9620\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2015-5276 (Low)\n	The std::random_device class in libstdc++ in the GNU Compiler Collection (aka GCC) before 4.9.4 does not properly handle short reads from blocking sources, which makes it easier for context-dependent attackers to predict the random values via unspecified vectors.\n\n	Package:       gcc-4.8 @ 4.8.4-2ubuntu1~14.04.3\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2015-5276\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-7426 (Low)\n	When ntpd is configured with rate limiting for all associations (restrict default limited in ntp.conf), the limits are applied also to responses received from its configured sources. An attacker who knows the sources (e.g., from an IPv4 refid in server response) and knows the system is (mis)configured in this way can periodically send packets with spoofed source address to keep the rate limiting activated and prevent ntpd from accepting valid responses from its sources.\n\n	Package:       ntp @ 1:4.2.6.p5+dfsg-3ubuntu2.14.04.10\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-7426\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2014-9621 (Low)\n	The ELF parser in file 5.16 through 5.21 allows remote attackers to cause a denial of service via a long string.\n\n	Package:       file @ 1:5.14-2ubuntu3.3\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2014-9621\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-2519 (Low)\n	ctl_getitem() return value not always checked\n\n	Package:       ntp @ 1:4.2.6.p5+dfsg-3ubuntu2.14.04.10\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-2519\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-6323 (Low)\n	The makecontext function in the GNU C Library (aka glibc or libc6) before 2.25 creates execution contexts incompatible with the unwinder on ARM EABI (32-bit) platforms, which might allow context-dependent attackers to cause a denial of service (hang), as demonstrated by applications compiled using gccgo, related to backtrace generation.\n\n	Package:       eglibc @ 2.19-0ubuntu6.11\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-6323\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-8610 (Low)\n	Certain warning alerts are ignored if they are received. This can mean that no progress will be made if one peer continually sends those warning alerts.\n\n	Package:       gnutls26 @ 2.12.23-12ubuntu2.7\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-8610\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-1234 (Low)\n	Stack-based buffer overflow in the glob implementation in GNU C Library (aka glibc) before 2.24, when GLOB_ALTDIRFUNC is used, allows context-dependent attackers to cause a denial of service (crash) via a long name.\n\n	Package:       eglibc @ 2.19-0ubuntu6.11\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-1234\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2013-4235 (Low)\n	TOCTOU race conditions by copying and removing directory trees\n\n	Package:       shadow @ 1:4.1.5.1-1ubuntu9.5\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2013-4235\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-0634 (Low)\n	bash prompt expanding $HOSTNAME\n\n	Package:       bash @ 4.3-7ubuntu1.7\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-0634\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-7427 (Low)\n	The broadcast mode of NTP is expected to only be used in a trusted network. If the broadcast network is accessible to an attacker, a potentially exploitable denial of service vulnerability in ntpd\'s broadcast mode replay prevention functionality can be abused. An attacker with access to the NTP broadcast domain can periodically inject specially crafted broadcast mode NTP packets into the broadcast domain which, while being logged by ntpd, can cause ntpd to reject broadcast mode packets from legitimate NTP broadcast servers.\n\n	Package:       ntp @ 1:4.2.6.p5+dfsg-3ubuntu2.14.04.10\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-7427\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-2183 (Low)\n	The DES and Triple DES ciphers, as used in the TLS, SSH, and IPSec protocols and other protocols and products, have a birthday bound of approximately four billion blocks, which makes it easier for remote attackers to obtain cleartext data via a birthday attack against a long-duration encrypted session, as demonstrated by an HTTPS session using Triple DES in CBC mode, aka a \"Sweet32\" attack.\n\n	Package:       gnutls26 @ 2.12.23-12ubuntu2.7\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-2183\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-2090 (Low)\n	Heap buffer overflow in fgetwln function of libbsd\n\n	Package:       libbsd @ 0.6.0-2ubuntu1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-2090\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2014-5044 (Low)\n	Array memory allocations could cause an integer overflow and thus memory overflow issues at runtime.\n\n	Package:       gcc-4.8 @ 4.8.4-2ubuntu1~14.04.3\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2014-5044\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-2774 (Low)\n	ISC DHCP 4.1.x before 4.1-ESV-R13 and 4.2.x and 4.3.x before 4.3.4 does not restrict the number of concurrent TCP sessions, which allows remote attackers to cause a denial of service (INSIST assertion failure or request-processing outage) by establishing many sessions.\n\n	Package:       isc-dhcp @ 4.2.4-7ubuntu12.10\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-2774\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-3706 (Low)\n	Stack-based buffer overflow in the getaddrinfo function in sysdeps/posix/getaddrinfo.c in the GNU C Library (aka glibc or libc6) allows remote attackers to cause a denial of service (crash) via vectors involving hostent conversion. NOTE: this vulnerability exists because of an incomplete fix for CVE-2013-4458.\n\n	Package:       eglibc @ 2.19-0ubuntu6.11\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-3706\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2014-9761 (Low)\n	Multiple stack-based buffer overflows in the GNU C Library (aka glibc or libc6) before 2.23 allow context-dependent attackers to cause a denial of service (application crash) or possibly execute arbitrary code via a long argument to the (1) nan, (2) nanf, or (3) nanl function.\n\n	Package:       eglibc @ 2.19-0ubuntu6.11\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2014-9761\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2015-5180 (Low)\n	DNS resolver NULL pointer dereference with crafted record type\n\n	Package:       eglibc @ 2.19-0ubuntu6.11\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2015-5180\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2015-5186 (Negligible)\n	log terminal emulator escape sequences handling\n\n	Package:       audit @ 1:2.3.2-2ubuntu1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2015-5186\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\nCVE-2016-7032 (Negligible)\n	noexec bypass via system() and popen()\n\n	Package:       sudo @ 1.8.9p5-1ubuntu1.4\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-7032\n	Layer:         sha256:1d8592394ba1ae81037e16fac3382070ce1478cf7f6c68d538c62ba067e111db\n\n', '4', '1', '73.05025');
