INSERT INTO `clair_result` VALUES ('57', 'onlineshop/nginx:latest', 'admin', 'onlineshop', '25', '111', 'CVE-2016-5300 (High)\n	The XML parser in Expat does not use sufficient entropy for hash initialization, which allows context-dependent attackers to cause a denial of service (CPU consumption) via crafted identifiers in an XML document.  NOTE: this vulnerability exists because of an incomplete fix for CVE-2012-0876.\n\n	Package:       expat @ 2.1.0-6+deb8u2\n	Fixed version: 2.1.0-6+deb8u3\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-5300\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2015-7554 (High)\n	The _TIFFVGetField function in tif_dir.c in libtiff 4.0.6 allows attackers to cause a denial of service (invalid memory write and crash) or possibly have unspecified other impact via crafted field data in an extension tag in a TIFF image.\n\n	Package:       tiff @ 4.0.3-12.3+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-7554\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2016-4658 (High)\n	libxml2 in Apple iOS before 10, OS X before 10.12, tvOS before 10, and watchOS before 3 allows remote attackers to execute arbitrary code or cause a denial of service (memory corruption) via a crafted XML document.\n\n	Package:       libxml2 @ 2.9.1+dfsg1-5+deb8u1\n	Fixed version: 2.9.1+dfsg1-5+deb8u4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-4658\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2015-1258 (High)\n	Google Chrome before 43.0.2357.65 relies on libvpx code that was not built with an appropriate --size-limit value, which allows remote attackers to trigger a negative value for a size field, and consequently cause a denial of service or possibly have unspecified other impact, via a crafted frame size in VP9 video data.\n\n	Package:       libvpx @ 1.3.0-3\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-1258\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2016-4429 (High)\n	Stack-based buffer overflow in the clntudp_call function in sunrpc/clnt_udp.c in the GNU C Library (aka glibc or libc6) allows remote servers to cause a denial of service (crash) or possibly unspecified other impact via a flood of crafted ICMP and UDP packets.\n\n	Package:       glibc @ 2.19-18+deb8u4\n	Fixed version: 2.19-18+deb8u5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-4429\n	Layer:         sha256:8728ce3f8dfb1930b7c5c23f9ef001ae50f0691163d36b26c68a9fed1778314b\n\nCVE-2014-9761 (High)\n	Multiple stack-based buffer overflows in the GNU C Library (aka glibc or libc6) before 2.23 allow context-dependent attackers to cause a denial of service (application crash) or possibly execute arbitrary code via a long argument to the (1) nan, (2) nanf, or (3) nanl function.\n\n	Package:       glibc @ 2.19-18+deb8u4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2014-9761\n	Layer:         sha256:8728ce3f8dfb1930b7c5c23f9ef001ae50f0691163d36b26c68a9fed1778314b\n\nCVE-2016-1238 (High)\n	(1) cpan/Archive-Tar/bin/ptar, (2) cpan/Archive-Tar/bin/ptardiff, (3) cpan/Archive-Tar/bin/ptargrep, (4) cpan/CPAN/scripts/cpan, (5) cpan/Digest-SHA/shasum, (6) cpan/Encode/bin/enc2xs, (7) cpan/Encode/bin/encguess, (8) cpan/Encode/bin/piconv, (9) cpan/Encode/bin/ucmlint, (10) cpan/Encode/bin/unidump, (11) cpan/ExtUtils-MakeMaker/bin/instmodsh, (12) cpan/IO-Compress/bin/zipdetails, (13) cpan/JSON-PP/bin/json_pp, (14) cpan/Test-Harness/bin/prove, (15) dist/ExtUtils-ParseXS/lib/ExtUtils/xsubpp, (16) dist/Module-CoreList/corelist, (17) ext/Pod-Html/bin/pod2html, (18) utils/c2ph.PL, (19) utils/h2ph.PL, (20) utils/h2xs.PL, (21) utils/libnetcfg.PL, (22) utils/perlbug.PL, (23) utils/perldoc.PL, (24) utils/perlivp.PL, and (25) utils/splain.PL in Perl 5.x before 5.22.3-RC2 and 5.24 before 5.24.1-RC2 do not properly remove . (period) characters from the end of the includes directory array, which might allow local users to gain privileges via a Trojan horse module under the current working directory.\n\n	Package:       perl @ 5.20.2-3+deb8u4\n	Fixed version: 5.20.2-3+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-1238\n	Layer:         sha256:8728ce3f8dfb1930b7c5c23f9ef001ae50f0691163d36b26c68a9fed1778314b\n\nCVE-2016-6303 (High)\n	Integer overflow in the MDC2_Update function in crypto/mdc2/mdc2dgst.c in OpenSSL before 1.1.0 allows remote attackers to cause a denial of service (out-of-bounds write and application crash) or possibly have unspecified other impact via unknown vectors.\n\n	Package:       openssl @ 1.0.1k-3+deb8u5\n	Fixed version: 1.0.1t-1+deb8u4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-6303\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2016-9539 (High)\n	tools/tiffcrop.c in libtiff 4.0.6 has an out-of-bounds read in readContigTilesIntoBuffer(). Reported as MSVR 35092.\n\n	Package:       tiff @ 4.0.3-12.3+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-9539\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2016-9533 (High)\n	tif_pixarlog.c in libtiff 4.0.6 has out-of-bounds write vulnerabilities in heap allocated buffers. Reported as MSVR 35094, aka \"PixarLog horizontalDifference heap-buffer-overflow.\"\n\n	Package:       tiff @ 4.0.3-12.3+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-9533\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2016-9538 (High)\n	tools/tiffcrop.c in libtiff 4.0.6 reads an undefined buffer in readContigStripsIntoBuffer() because of a uint16 integer overflow. Reported as MSVR 35100.\n\n	Package:       tiff @ 4.0.3-12.3+deb8u1\n	Link:  