g length fields, which trigger out-of-bounds write operations.\n\n	Package:       libx11 @ 2:1.6.2-3\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-7943\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2016-9535 (High)\n	tif_predict.h and tif_predict.c in libtiff 4.0.6 have assertions that can lead to assertion failures in debug mode, or buffer overflows in release mode, when dealing with unusual tile size like YCbCr with subsampling. Reported as MSVR 35105, aka \"Predictor heap-buffer-overflow.\"\n\n	Package:       tiff @ 4.0.3-12.3+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-9535\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2016-7942 (High)\n	The XGetImage function in X.org libX11 before 1.6.4 might allow remote X servers to gain privileges via vectors involving image type and geometry, which triggers out-of-bounds read operations.\n\n	Package:       libx11 @ 2:1.6.2-3\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-7942\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2016-9537 (High)\n	tools/tiffcrop.c in libtiff 4.0.6 has out-of-bounds write vulnerabilities in buffers. Reported as MSVR 35093, MSVR 35096, and MSVR 35097.\n\n	Package:       tiff @ 4.0.3-12.3+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-9537\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2016-9536 (High)\n	tools/tiff2pdf.c in libtiff 4.0.6 has out-of-bounds write vulnerabilities in heap allocated buffers in t2p_process_jpeg_strip(). Reported as MSVR 35098, aka \"t2p_process_jpeg_strip heap-buffer-overflow.\"\n\n	Package:       tiff @ 4.0.3-12.3+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-9536\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2016-2182 (High)\n	The BN_bn2dec function in crypto/bn/bn_print.c in OpenSSL before 1.1.0 does not properly validate division results, which allows remote attackers to cause a denial of service (out-of-bounds write and application crash) or possibly have unspecified other impact via unknown vectors.\n\n	Package:       openssl @ 1.0.1k-3+deb8u5\n	Fixed version: 1.0.1t-1+deb8u4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-2182\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2012-6702 (Medium)\n	Expat, when used in a parser that has not called XML_SetHashSalt or passed it a seed of 0, makes it easier for context-dependent attackers to defeat cryptographic protection mechanisms via vectors involving use of the srand function.\n\n	Package:       expat @ 2.1.0-6+deb8u2\n	Fixed version: 2.1.0-6+deb8u3\n	Link:          https://security-tracker.debian.org/tracker/CVE-2012-6702\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2016-6207 (Medium)\n	Integer overflow in the _gdContributionsAlloc function in gd_interpolation.c in GD Graphics Library (aka libgd) before 2.2.3 allows remote attackers to cause a denial of service (out-of-bounds memory write or memory consumption) via unspecified vectors.\n\n	Package:       libgd2 @ 2.1.0-5+deb8u1\n	Fixed version: 2.1.0-5+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-6207\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2016-3620 (Medium)\n	The ZIPEncode function in tif_zip.c in the bmp2tiff tool in LibTIFF 4.0.6 and earlier, when the \"-c zip\" option is used, allows remote attackers to cause a denial of service (buffer over-read) via a crafted BMP image.\n\n	Package:       tiff @ 4.0.3-12.3+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3620\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2016-2181 (Medium)\n	The Anti-Replay feature in the DTLS implementation in OpenSSL before 1.1.0 mishandles early use of a new epoch number in conjunction with a large sequence number, which allows remote attackers to cause a denial of service (false-positive packet drops) via spoofed DTLS records, related to rec_layer_d1.c and ssl3_record.c.\n\n	Package:       openssl @ 1.0.1k-3+deb8u5\n	Fixed version: 1.0.1t-1+deb8u4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-2181\n	Layer:         sha256:5bd125039dd82b83ba7d59cf24e3990ec90e5a6d325fca9e4f6102dcbcbefa3d\n\nCVE-2016-6321 (Medium)\n	Directory traversal vulnerability in the safer_name_suffix function in GNU tar 1.14 through 1.29 might allow remote attackers to bypass an intended protection mechanism and write to arbitrary files via vectors related to improper sanitization of the file_name parameter, aka POINTYFEATHER.\n\n	Package:       tar @ 1.27.1-2\n	Fixed version: 1.27.1-2+deb8u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-6321\n	Layer:         sha256:8728ce3f8dfb1930b7c5c23f9ef001ae50f0691163d36b26c68a9fed1778314b\n\nCVE-2016-6185 (Medium)\n	The XSLoader::load method in XSLoader in Perl does not properly locate .so files when called in a string eval, which might allow local users to execute arbitrary code via a Trojan horse library under the current working directory.\n\n	Package:       perl @ 5.20.2-3+deb8u4\n	Fixed version: 5.20.2-3+deb8u6\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-6185\n	Layer:         sha256:8728ce3f8dfb1930b7c5c23f9ef001ae50f0691163d36b26c68a9fed1778314b\n\nCVE-2015-8853 (Medium)\n	The (1) S_reghop3, (2) S_reghop4, and (3) S_reghopmaybe3 functions in regexec.c in Perl before 5.24.0 allow context-dependent attackers to cause a denial of service (infinite loop) via crafted utf-8 data, as demonstrated by \"a\\x80.\"\n\n	Package:       perl @ 5.20.2-3+deb8u4\n	Fixed versi