INSERT INTO `clair_result` VALUES ('60', 'onlineshop/jenkins:2.60.3', 'admin', 'onlineshop', '3', '45', 'CVE-2015-8668 (High)\n	Heap-based buffer overflow in the PackBitsPreEncode function in tif_packbits.c in bmp2tiff in libtiff 4.0.6 and earlier allows remote attackers to execute arbitrary code or cause a denial of service via a large width field in a BMP image.\n\n	Package:       tiff @ 4.0.8-2+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-8668\n	Layer:         sha256:5614d71be11e314453623891e3346c4627e74af657fee3c2c2d6a18429ba5724\n\nCVE-2016-7167 (High)\n	Multiple integer overflows in the (1) curl_escape, (2) curl_easy_escape, (3) curl_unescape, and (4) curl_easy_unescape functions in libcurl before 7.50.3 allow attackers to have unspecified impact via a string of length 0xffffffff, which triggers a heap-based buffer overflow.\n\n	Package:       curl @ 7.52.1-5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-7167\n	Layer:         sha256:6b2eb15e2b2e4a9b35f4153533b1fd7b75004904798f96a16e0c0fad2181b437\n\nCVE-2015-7554 (High)\n	The _TIFFVGetField function in tif_dir.c in libtiff 4.0.6 allows attackers to cause a denial of service (invalid memory write and crash) or possibly have unspecified other impact via crafted field data in an extension tag in a TIFF image.\n\n	Package:       tiff @ 4.0.8-2+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-7554\n	Layer:         sha256:5614d71be11e314453623891e3346c4627e74af657fee3c2c2d6a18429ba5724\n\nCVE-2016-3632 (Medium)\n	The _TIFFVGetField function in tif_dirinfo.c in LibTIFF 4.0.6 and earlier allows remote attackers to cause a denial of service (out-of-bounds write) or execute arbitrary code via a crafted TIFF image.\n\n	Package:       tiff @ 4.0.8-2+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3632\n	Layer:         sha256:5614d71be11e314453623891e3346c4627e74af657fee3c2c2d6a18429ba5724\n\nCVE-2016-3634 (Medium)\n	The tagCompare function in tif_dirinfo.c in the thumbnail tool in LibTIFF 4.0.6 and earlier allows remote attackers to cause a denial of service (out-of-bounds read) via vectors related to field_tag matching.\n\n	Package:       tiff @ 4.0.8-2+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3634\n	Layer:         sha256:5614d71be11e314453623891e3346c4627e74af657fee3c2c2d6a18429ba5724\n\nCVE-2011-3389 (Medium)\n	The SSL protocol, as used in certain configurations in Microsoft Windows and Microsoft Internet Explorer, Mozilla Firefox, Google Chrome, Opera, and other products, encrypts data by using CBC mode with chained initialization vectors, which allows man-in-the-middle attackers to obtain plaintext HTTP headers via a blockwise chosen-boundary attack (BCBA) on an HTTPS session, in conjunction with JavaScript code that uses (1) the HTML5 WebSocket API, (2) the Java URLConnection API, or (3) the Silverlight WebClient API, aka a \"BEAST\" attack.\n\n	Package:       gnutls28 @ 3.5.8-5+deb9u2\n	Link:          https://security-tracker.debian.org/tracker/CVE-2011-3389\n	Layer:         sha256:6b2eb15e2b2e4a9b35f4153533b1fd7b75004904798f96a16e0c0fad2181b437\n\nCVE-2016-3619 (Medium)\n	The DumpModeEncode function in tif_dumpmode.c in the bmp2tiff tool in LibTIFF 4.0.6 and earlier, when the \"-c none\" option is used, allows remote attackers to cause a denial of service (buffer over-read) via a crafted BMP image.\n\n	Package:       tiff @ 4.0.8-2+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3619\n	Layer:         sha256:5614d71be11e314453623891e3346c4627e74af657fee3c2c2d6a18429ba5724\n\nCVE-2016-9318 (Medium)\n	libxml2 2.9.4 and earlier, as used in XMLSec 1.2.23 and earlier and other products, does not offer a flag directly indicating that the current document may be read but other files may not be opened, which makes it easier for remote attackers to conduct XML External Entity (XXE) attacks via a crafted document.\n\n	Package:       libxml2 @ 2.9.4+dfsg1-2.2+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-9318\n	Layer:         sha256:5614d71be11e314453623891e3346c4627e74af657fee3c2c2d6a18429ba5724\n\nCVE-2016-3621 (Medium)\n	The LZWEncode function in tif_lzw.c in the bmp2tiff tool in LibTIFF 4.0.6 and earlier, when the \"-c lzw\" option is used, allows remote attackers to cause a denial of service (buffer over-read) via a crafted BMP image.\n\n	Package:       tiff @ 4.0.8-2+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3621\n	Layer:         sha256:5614d71be11e314453623891e3346c4627e74af657fee3c2c2d6a18429ba5724\n\nCVE-2016-3620 (Medium)\n	The ZIPEncode function in tif_zip.c in the bmp2tiff tool in LibTIFF 4.0.6 and earlier, when the \"-c zip\" option is used, allows remote attackers to cause a denial of service (buffer over-read) via a crafted BMP image.\n\n	Package:       tiff @ 4.0.8-2+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3620\n	Layer:         sha256:5614d71be11e314453623891e3346c4627e74af657fee3c2c2d6a18429ba5724\n\nCVE-2016-7141 (Medium)\n	curl and libcurl before 7.50.2, when built with NSS and the libnsspem.so library is available at runtime, allow remote attackers to hijack the authentication of a TLS connection by leveraging reuse of a previously loaded client certificate from file for a connection for which no certificate has been set, a different vulnerability than CVE-2016-5420.\n\n	Package:       curl @ 7.52.1-5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-7141\n	Layer:         sha256:6b2eb15e2b2e4a9b35f4153533b1fd7b75004904798f96a16e0c0fad2181b437\n\nCVE-2016-3625 (Medium)\n	tif_read.c in the tiff2bw tool in LibTIFF 4.0.6 and earlier allows remote attackers to cause a denial of service (out-of-bounds read) via a crafted TIFF image.\n\n	Package:       tiff @ 4.0.8-2+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3625\n	Layer:         sha256:5614d71be11e314453623891e3346c4627e74af657fee3c2c2d6a18429ba5724\n\nCVE-2016-10009 (Low)\n	Package:       openssh @ 1:7.4p1-10+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-10009\n	Layer:         sha256:9f1b7fb4aad21aea5e9f46100014515f96df98f04d3952870bbc03aa1c0dde08\n\nCVE-2016-3189 (Low)\n	Use-after-free vulnerability in bzip2recover in bzip2 1.0.6 allows remote attackers to cause a denial of service (crash) via a crafted bzip2 file, related to block ends set to before the start of the block.\n\n	Package:       bzip2 @ 1.0.6-8.1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3189\n	Layer:         sha256:219d2e45b4afc3d80375a2fcf76505684de01f55027fb35a691099f0e538fdd8\n\nCVE-2016-10011 (Low)\n	Package:       openssh @ 1:7.4p1-10+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-10011\n	Layer:         sha256:9f1b7fb4aad21aea5e9f46100014515f96df98f04d3952870bbc03aa1c0dde08\n\nCVE-2016-10012 (Low)\n	Package:       openssh @ 1:7.4p1-10+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-10012\n	Layer:         sha256:9f1b7fb4aad21aea5e9f46100014515f96df98f04d3952870bbc03aa1c0dde08\n\nCVE-2015-5180 (Low)\n	Package:       glibc @ 2.24-11+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-5180\n	Layer:         sha256:219d2e45b4afc3d80375a2fcf76505684de01f55027fb35a691099f0e538fdd8\n\nCVE-2016-7055 (Low)\n	Package:       openssl1.0 @ 1.0.2l-2\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-7055\n	Layer:         sha256:6b2eb15e2b2e4a9b35f4153533b1fd7b75004904798f96a16e0c0fad2181b437\n\nCVE-2010-4756 (Negligible)\n	The glob implementation in the GNU C Library (aka glibc or libc6) allows remote authenticated users to cause a denial of service (CPU and memory consumption) via crafted glob expressions that do not match any pathnames, as demonstrated by glob expressions in STAT commands to an FTP daemon, a different vulnerability than CVE-2010-2632.\n\n	Package:       glibc @ 2.24-11+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2010-4756\n	Layer:         sha256:219d2e45b4afc3d80375a2fcf76505684de01f55027fb35a691099f0e538fdd8\n\nCVE-2015-3276 (Negligible)\n	The nss_parse_ciphers function in libraries/libldap/tls_m.c in OpenLDAP does not properly parse OpenSSL-style multi-keyword mode cipher strings, which might cause a weaker than intended cipher to be used and allow remote attackers to have unspecified impact via unknown vectors.\n\n	Package:       openldap @ 2.4.44+dfsg-5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2015-3276\n	Layer:         sha256:6b2eb15e2b2e4a9b35f4153533b1fd7b75004904798f96a16e0c0fad2181b437\n\nCVE-2007-6755 (Negligible)\n	The NIST SP 800-90A default statement of the Dual Elliptic Curve Deterministic Random Bit Generation (Dual_EC_DRBG) algorithm contains point Q constants with a possible relationship to certain \"skeleton key\" values, which might allow context-dependent attackers to defeat cryptographic protection mechanisms by leveraging knowledge of those values.  NOTE: this is a preliminary CVE for Dual_EC_DRBG; future research may provide additional details about point Q and associated attacks, and could potentially lead to a RECAST or REJECT of this CVE.\n\n	Package:       openssl @ 1.1.0f-3\n	Link:          https://security-tracker.debian.org/tracker/CVE-2007-6755\n	Layer:         sha256:6b2eb15e2b2e4a9b35f4153533b1fd7b75004904798f96a16e0c0fad2181b437\n\nCVE-2012-3878 (Negligible)\n	Package:       perl @ 5.24.1-3+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2012-3878\n	Layer:         sha256:219d2e45b4afc3d80375a2fcf76505684de01f55027fb35a691099f0e538fdd8\n\nCVE-2016-10010 (Negligible)\n	Package:       openssh @ 1:7.4p1-10+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-10010\n	Layer:         sha256:9f1b7fb4aad21aea5e9f46100014515f96df98f04d3952870bbc03aa1c0dde08\n\nCVE-2010-0928 (Negligible)\n	OpenSSL 0.9.8i on the Gaisler Research LEON3 SoC on the Xilinx Virtex-II Pro FPGA uses a Fixed Width Exponentiation (FWE) algorithm for certain signature calculations, and does not verify the signature before providing it to a caller, which makes it easier for physically proximate attackers to determine the private key via a modified supply voltage for the microprocessor, related to a \"fault-based attack.\"\n\n	Package:       openssl @ 1.1.0f-3\n	Link:          https://security-tracker.debian.org/tracker/CVE-2010-0928\n	Layer:         sha256:6b2eb15e2b2e4a9b35f4153533b1fd7b75004904798f96a16e0c0fad2181b437\n\nCVE-2008-3234 (Negligible)\n	sshd in OpenSSH 4 on Debian GNU/Linux, and the 20070303 OpenSSH snapshot, allows remote authenticated users to obtain access to arbitrary SELinux roles by appending a :/ (colon slash) sequence, followed by the role name, to the username.\n\n	Package:       openssh @ 1:7.4p1-10+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2008-3234\n	Layer:         sha256:9f1b7fb4aad21aea5e9f46100014515f96df98f04d3952870bbc03aa1c0dde08\n\nCVE-2011-3374 (Negligible)\n	Package:       apt @ 1.4.7\n	Link:          https://security-tracker.debian.org/tracker/CVE-2011-3374\n	Layer:         sha256:219d2e45b4afc3d80375a2fcf76505684de01f55027fb35a691099f0e538fdd8\n\nCVE-2016-8620 (Negligible)\n	Package:       curl @ 7.52.1-5\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-8620\n	Layer:         sha256:6b2eb15e2b2e4a9b35f4153533b1fd7b75004904798f96a16e0c0fad2181b437\n\nCVE-2013-0340 (Negligible)\n	expat 2.1.0 and earlier does not properly handle entities expansion unless an application developer uses the XML_SetEntityDeclHandler function, which allows remote attackers to cause a denial of service (resource consumption), send HTTP requests to intranet servers, or read arbitrary files via a crafted XML document, aka an XML External Entity (XXE) issue.  NOTE: it could be argued that because expat already provides the ability to disable external entity expansion, the responsibility for resolving this issue lies with application developers; according to this argument, this entry should be REJECTed, and each affected application would need its own CVE.\n\n	Package:       expat @ 2.2.0-2+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2013-0340\n	Layer:         sha256:9f1b7fb4aad21aea5e9f46100014515f96df98f04d3952870bbc03aa1c0dde08\n\nCVE-2012-0039 (Negligible)\n	** DISPUTED ** GLib 2.31.8 and earlier, when the g_str_hash function is used, computes hash values without restricting the ability to trigger hash collisions predictably, which allows context-dependent attackers to cause a denial of service (CPU consumption) via crafted input to an application that maintains a hash table.  NOTE: this issue may be disputed by the vendor; the existence of the g_str_hash function is not a vulnerability in the library, because callers of g_hash_table_new and g_hash_table_new_full can specify an arbitrary hash function that is appropriate for the application.\n\n	Package:       glib2.0 @ 2.50.3-2\n	Link:          https://security-tracker.debian.org/tracker/CVE-2012-0039\n	Layer:         sha256:5614d71be11e314453623891e3346c4627e74af657fee3c2c2d6a18429ba5724\n\nCVE-2013-4392 (Negligible)\n	systemd, when updating file permissions, allows local users to change the permissions and SELinux security contexts for arbitrary files via a symlink attack on unspecified files.\n\n	Package:       systemd @ 232-25+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2013-4392\n	Layer:         sha256:219d2e45b4afc3d80375a2fcf76505684de01f55027fb35a691099f0e538fdd8\n\nCVE-2016-3177 (Negligible)\n	Package:       giflib @ 5.1.4-0.4\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-3177\n	Layer:         sha256:5614d71be11e314453623891e3346c4627e74af657fee3c2c2d6a18429ba5724\n\nCVE-2013-4235 (Negligible)\n	Package:       shadow @ 1:4.4-4.1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2013-4235\n	Layer:         sha256:219d2e45b4afc3d80375a2fcf76505684de01f55027fb35a691099f0e538fdd8\n\nCVE-2013-7040 (Negligible)\n	Python 2.7 before 3.4 only uses the last eight bits of the prefix to randomize hash values, which causes it to compute hash values without restricting the ability to trigger hash collisions predictably and makes it easier for context-dependent attackers to cause a denial of service (CPU consumption) via crafted input to an application that maintains a hash table.  NOTE: this vulnerability exists because of an incomplete fix for CVE-2012-1150.\n\n	Package:       python2.7 @ 2.7.13-2\n	Link:          https://security-tracker.debian.org/tracker/CVE-2013-7040\n	Layer:         sha256:9f1b7fb4aad21aea5e9f46100014515f96df98f04d3952870bbc03aa1c0dde08\n\nCVE-2016-6252 (Negligible)\n	Package:       shadow @ 1:4.4-4.1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-6252\n	Layer:         sha256:219d2e45b4afc3d80375a2fcf76505684de01f55027fb35a691099f0e538fdd8\n\nCVE-2016-6251 (Negligible)\n	Package:       shadow @ 1:4.4-4.1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-6251\n	Layer:         sha256:219d2e45b4afc3d80375a2fcf76505684de01f55027fb35a691099f0e538fdd8\n\nCVE-2008-4108 (Negligible)\n	Tools/faqwiz/move-faqwiz.sh (aka the generic FAQ wizard moving tool) in Python 2.4.5 might allow local users to overwrite arbitrary files via a symlink attack on a tmp$RANDOM.tmp temporary file.  NOTE: there may not be common usage scenarios in which tmp$RANDOM.tmp is located in an untrusted directory.\n\n	Package:       python-defaults @ 2.7.13-2\n	Link:          https://security-tracker.debian.org/tracker/CVE-2008-4108\n	Layer:         sha256:9f1b7fb4aad21aea5e9f46100014515f96df98f04d3952870bbc03aa1c0dde08\n\nCVE-2010-4051 (Negligible)\n	The regcomp implementation in the GNU C Library (aka glibc or libc6) through 2.11.3, and 2.12.x through 2.12.2, allows context-dependent attackers to cause a denial of service (application crash) via a regular expression containing adjacent bounded repetitions that bypass the intended RE_DUP_MAX limitation, as demonstrated by a {10,}{10,}{10,}{10,}{10,} sequence in the proftpd.gnu.c exploit for ProFTPD, related to a \"RE_DUP_MAX overflow.\"\n\n	Package:       glibc @ 2.24-11+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2010-4051\n	Layer:         sha256:219d2e45b4afc3d80375a2fcf76505684de01f55027fb35a691099f0e538fdd8\n\nCVE-2005-2541 (Negligible)\n	Tar 1.15.1 does not properly warn the user when extracting setuid or setgid files, which may allow local users or remote attackers to gain privileges.\n\n	Package:       tar @ 1.29b-1.1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2005-2541\n	Layer:         sha256:219d2e45b4afc3d80375a2fcf76505684de01f55027fb35a691099f0e538fdd8\n\nCVE-2011-4116 (Negligible)\n	Package:       perl @ 5.24.1-3+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2011-4116\n	Layer:         sha256:219d2e45b4afc3d80375a2fcf76505684de01f55027fb35a691099f0e538fdd8\n\nCVE-2014-8166 (Negligible)\n	Package:       cups @ 2.2.1-8\n	Link:          https://security-tracker.debian.org/tracker/CVE-2014-8166\n	Layer:         sha256:5614d71be11e314453623891e3346c4627e74af657fee3c2c2d6a18429ba5724\n\nCVE-2014-8130 (Negligible)\n	Package:       tiff @ 4.0.8-2+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2014-8130\n	Layer:         sha256:5614d71be11e314453623891e3346c4627e74af657fee3c2c2d6a18429ba5724\n\nCVE-2016-5319 (Negligible)\n	Package:       tiff @ 4.0.8-2+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-5319\n	Layer:         sha256:5614d71be11e314453623891e3346c4627e74af657fee3c2c2d6a18429ba5724\n\nCVE-2007-2768 (Negligible)\n	OpenSSH, when using OPIE (One-Time Passwords in Everything) for PAM, allows remote attackers to determine the existence of certain user accounts, which displays a different response if the user account exists and is configured to use one-time passwords (OTP), a similar issue to CVE-2007-2243.\n\n	Package:       openssh @ 1:7.4p1-10+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2007-2768\n	Layer:         sha256:9f1b7fb4aad21aea5e9f46100014515f96df98f04d3952870bbc03aa1c0dde08\n\nCVE-2004-0971 (Negligible)\n	The krb5-send-pr script in the kerberos5 (krb5) package in Trustix Secure Linux 1.5 through 2.1, and possibly other operating systems, allows local users to overwrite files via a symlink attack on temporary files.\n\n	Package:       krb5 @ 1.15-1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2004-0971\n	Layer:         sha256:6b2eb15e2b2e4a9b35f4153533b1fd7b75004904798f96a16e0c0fad2181b437\n\nCVE-2016-2779 (Negligible)\n	Package:       util-linux @ 2.29.2-1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2016-2779\n	Layer:         sha256:219d2e45b4afc3d80375a2fcf76505684de01f55027fb35a691099f0e538fdd8\n\nCVE-2007-2243 (Negligible)\n	OpenSSH 4.6 and earlier, when ChallengeResponseAuthentication is enabled, allows remote attackers to determine the existence of user accounts by attempting to authenticate via S/KEY, which displays a different response if the user account exists, a similar issue to CVE-2001-1483.\n\n	Package:       openssh @ 1:7.4p1-10+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2007-2243\n	Layer:         sha256:9f1b7fb4aad21aea5e9f46100014515f96df98f04d3952870bbc03aa1c0dde08\n\nCVE-2010-4052 (Negligible)\n	Stack consumption vulnerability in the regcomp implementation in the GNU C Library (aka glibc or libc6) through 2.11.3, and 2.12.x through 2.12.2, allows context-dependent attackers to cause a denial of service (resource exhaustion) via a regular expression containing adjacent repetition operators, as demonstrated by a {10,}{10,}{10,}{10,} sequence in the proftpd.gnu.c exploit for ProFTPD.\n\n	Package:       glibc @ 2.24-11+deb9u1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2010-4052\n	Layer:         sha256:219d2e45b4afc3d80375a2fcf76505684de01f55027fb35a691099f0e538fdd8\n\nCVE-2007-5686 (Negligible)\n	initscripts in rPath Linux 1 sets insecure permissions for the /var/log/btmp file, which allows local users to obtain sensitive information regarding authentication attempts.  NOTE: because sshd detects the insecure permissions and does not log certain events, this also prevents sshd from logging failed authentication attempts by remote attackers.\n\n	Package:       shadow @ 1:4.4-4.1\n	Link:          https://security-tracker.debian.org/tracker/CVE-2007-5686\n	Layer:         sha256:219d2e45b4afc3d80375a2fcf76505684de01f55027fb35a691099f0e538fdd8\n\n', '5', '1', '349.53203');
