INSERT INTO `clair_result` VALUES ('62', 'onlineshop/fabric-membersrvc:0.6', 'admin', 'onlineshop', '2', '225', 'CVE-2016-6304 (High)\n	Multiple memory leaks in t1_lib.c in OpenSSL before 1.0.1u, 1.0.2 before 1.0.2i, and 1.1.0 before 1.1.0a allow remote attackers to cause a denial of service (memory consumption) via large OCSP Status Request extensions.\n\n	Package:       openssl @ 1.0.1f-1ubuntu2.19\n	Fixed version: 1.0.1f-1ubuntu2.20\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-6304\n	Layer:         sha256:862a3e9af0aeffe79345b790bad31baaa61e9402b6e616bff17babed6b053b54\n\nCVE-2016-1252 (High)\n	A man-in-the-middle attacker could circumvent the InRelease signature of a repository, leading to a malicious package being installed and, therefore, remote arbitrary code execution.\n\n	Package:       apt @ 1.0.1ubuntu2.14\n	Fixed version: 1.0.1ubuntu2.17\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-1252\n	Layer:         sha256:862a3e9af0aeffe79345b790bad31baaa61e9402b6e616bff17babed6b053b54\n\nCVE-2016-8624 (Medium)\n	invalid URL parsing with \'#\'\n\n	Package:       curl @ 7.35.0-1ubuntu2.8\n	Fixed version: 7.35.0-1ubuntu2.10\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-8624\n	Layer:         sha256:619b1ba840e1e06ba0c32fe720f12961bf54035350326cd5562513d741950ae2\n\nCVE-2016-8654 (Medium)\n	[Heap-based buffer overflow in QMFB code in JPC codec]\n\n	Package:       jasper @ 1.900.1-14ubuntu3.3\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-8654\n	Layer:         sha256:80983e976c3c625a16b3d8457cc7afa8afb24c14ce6c30d598276bd036e55abf\n\nCVE-2015-8870 (Medium)\n	Integer overflow in tools/bmp2tiff.c in LibTIFF before 4.0.4 allows remote attackers to cause a denial of service (heap-based buffer over-read), or possibly obtain sensitive information from process memory, via crafted width and length values in RLE4 or RLE8 data in a BMP file.\n\n	Package:       tiff @ 4.0.3-7ubuntu0.4\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2015-8870\n	Layer:         sha256:80983e976c3c625a16b3d8457cc7afa8afb24c14ce6c30d598276bd036e55abf\n\nCVE-2016-0772 (Medium)\n	The smtplib library in CPython (aka Python) before 2.7.12, 3.x before 3.4.5, and 3.5.x before 3.5.2 does not return an error when StartTLS fails, which might allow man-in-the-middle attackers to bypass the TLS protections by leveraging a network position between the client and the registry to block the StartTLS command, aka a \"StartTLS stripping attack.\"\n\n	Package:       python2.7 @ 2.7.6-8ubuntu0.2\n	Fixed version: 2.7.6-8ubuntu0.3\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-0772\n	Layer:         sha256:80983e976c3c625a16b3d8457cc7afa8afb24c14ce6c30d598276bd036e55abf\n\nCVE-2016-1238 (Medium)\n	(1) cpan/Archive-Tar/bin/ptar, (2) cpan/Archive-Tar/bin/ptardiff, (3) cpan/Archive-Tar/bin/ptargrep, (4) cpan/CPAN/scripts/cpan, (5) cpan/Digest-SHA/shasum, (6) cpan/Encode/bin/enc2xs, (7) cpan/Encode/bin/encguess, (8) cpan/Encode/bin/piconv, (9) cpan/Encode/bin/ucmlint, (10) cpan/Encode/bin/unidump, (11) cpan/ExtUtils-MakeMaker/bin/instmodsh, (12) cpan/IO-Compress/bin/zipdetails, (13) cpan/JSON-PP/bin/json_pp, (14) cpan/Test-Harness/bin/prove, (15) dist/ExtUtils-ParseXS/lib/ExtUtils/xsubpp, (16) dist/Module-CoreList/corelist, (17) ext/Pod-Html/bin/pod2html, (18) utils/c2ph.PL, (19) utils/h2ph.PL, (20) utils/h2xs.PL, (21) utils/libnetcfg.PL, (22) utils/perlbug.PL, (23) utils/perldoc.PL, (24) utils/perlivp.PL, and (25) utils/splain.PL in Perl 5.x before 5.22.3-RC2 and 5.24 before 5.24.1-RC2 do not properly remove . (period) characters from the end of the includes directory array, which might allow local users to gain privileges via a Trojan horse module under the current working directory.\n\n	Package:       perl @ 5.18.2-2ubuntu1.1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-1238\n	Layer:         sha256:862a3e9af0aeffe79345b790bad31baaa61e9402b6e616bff17babed6b053b54\n\nCVE-2015-8138 (Medium)\n	Zero Origin Timestamp Bypass, AKA: Additional KoD Checks\n\n	Package:       ntp @ 1:4.2.6.p5+dfsg-3ubuntu2.14.04.8\n	Fixed version: 1:4.2.6.p5+dfsg-3ubuntu2.14.04.10\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2015-8138\n	Layer:         sha256:862a3e9af0aeffe79345b790bad31baaa61e9402b6e616bff17babed6b053b54\n\nCVE-2016-5582 (Medium)\n	Unspecified vulnerability in Oracle Java SE 6u121, 7u111, 8u102; and Java SE Embedded 8u101 allows remote attackers to affect confidentiality, integrity, and availability via vectors related to Hotspot, a different vulnerability than CVE-2016-5573.\n\n	Package:       openjdk-7 @ 7u111-2.6.7-0ubuntu0.14.04.3\n	Fixed version: 7u121-2.6.8-1ubuntu0.14.04.1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-5582\n	Layer:         sha256:80983e976c3c625a16b3d8457cc7afa8afb24c14ce6c30d598276bd036e55abf\n\nCVE-2016-4614 (Medium)\n	libxml2 in Apple iOS before 9.3.3, OS X before 10.11.6, iTunes before 12.4.2 on Windows, iCloud before 5.2.1 on Windows, tvOS before 9.2.2, and watchOS before 2.2.2 allows remote attackers to cause a denial of service (memory corruption) or possibly have unspecified other impact via unknown vectors, a different vulnerability than CVE-2016-4615, CVE-2016-4616, and CVE-2016-4619.\n\n	Package:       libxml2 @ 2.9.1+dfsg1-3ubuntu4.8\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-4614\n	Layer:         sha256:619b1ba840e1e06ba0c32fe720f12961bf54035350326cd5562513d741950ae2\n\nCVE-2016-5699 (Medium)\n	CRLF injection vulnerability in the HTTPConnection.putheader function in urllib2 and urllib in CPython (aka Python) before 2.7.10 and 3.x before 3.4.4 allows remote attackers to inject arbitrary HTTP headers via CRLF sequences in a URL.\n\n	Package:       python3.4 @ 3.4.3-1ubuntu1~14.04.3\n	Fixed version: 3.4.3-1ubuntu1~14.04.5\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-5699\n	Layer:         sha256:862a3e9af0aeffe79345b790bad31baaa61e9402b6e616bff17babed6b053b54\n\nCVE-2015-8865 (Medium)\n	The file_check_mem function in funcs.c in file before 5.23, as used in the Fileinfo component in PHP before 5.5.34, 5.6.x before 5.6.20, and 7.x before 7.0.5, mishandles continuation-level jumps, which allows context-dependent attackers to cause a denial of service (buffer overflow and application crash) or possibly execute arbitrary code via a crafted magic file.\n\n	Package:       file @ 1:5.14-2ubuntu3.3\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2015-8865\n	Layer:         sha256:862a3e9af0aeffe79345b790bad31baaa61e9402b6e616bff17babed6b053b54\n\nCVE-2016-5875 (Medium)\n	heap-based buffer overflow when using the PixarLog compression format\n\n	Package:       tiff @ 4.0.3-7ubuntu0.4\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-5875\n	Layer:         sha256:80983e976c3c625a16b3d8457cc7afa8afb24c14ce6c30d598276bd036e55abf\n\nCVE-2011-5325 (Medium)\n	path traversal vulnerability in busybox tar\n\n	Package:       busybox @ 1:1.21.0-1ubuntu1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2011-5325\n	Layer:         sha256:862a3e9af0aeffe79345b790bad31baaa61e9402b6e616bff17babed6b053b54\n\nCVE-2016-8620 (Medium)\n	glob parser write/read out of bounds\n\n	Package:       curl @ 7.35.0-1ubuntu2.8\n	Fixed version: 7.35.0-1ubuntu2.10\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-8620\n	Layer:         sha256:619b1ba840e1e06ba0c32fe720f12961bf54035350326cd5562513d741950ae2\n\nCVE-2016-2226 (Medium)\n	Exploitable buffer overflow\n\n	Package:       binutils @ 2.24-5ubuntu14.1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-2226\n	Layer:         sha256:9f4a5f266a0bc63b66ff45b45a8e887d573f714d886253674e0e91a0a04b9a42\n\nCVE-2015-8630 (Medium)\n	The (1) kadm5_create_principal_3 and (2) kadm5_modify_principal functions in lib/kadm5/srv/svr_principal.c in kadmind in MIT Kerberos 5 (aka krb5) 1.12.x and 1.13.x before 1.13.4 and 1.14.x before 1.14.1 allow remote authenticated users to cause a denial of service (NULL pointer dereference and daemon crash) by specifying KADM5_POLICY with a NULL policy name.\n\n	Package:       krb5 @ 1.12+dfsg-2ubuntu5.2\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2015-8630\n	Layer:         sha256:619b1ba840e1e06ba0c32fe720f12961bf54035350326cd5562513d741950ae2\n\nCVE-2016-8635 (Medium)\n	It was found that Diffie Hellman Client key exchange handling in NSS was vulnerable to small subgroup confinement attack. An attacker could use this flaw to recover private keys by confining the client DH key to small subgroup of the desired group.\n\n	Package:       nss @ 2:3.23-0ubuntu0.14.04.1\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-8635\n	Layer:         sha256:80983e976c3c625a16b3d8457cc7afa8afb24c14ce6c30d598276bd036e55abf\n\nCVE-2016-7429 (Medium)\n	When ntpd receives a server response on a socket that corresponds to a different interface than was used for the request, the peer structure is updated to use the interface for new requests. If ntpd is running on a host with multiple interfaces in separate networks and the operating system doesn\'t check source address in received packets (e.g. rp_filter on Linux is set to 0), an attacker that knows the address of the source can send a packet with spoofed source address which will cause ntpd to select wrong interface for the source and prevent it from sending new requests until the list of interfaces is refreshed\n\n	Package:       ntp @ 1:4.2.6.p5+dfsg-3ubuntu2.14.04.8\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-7429\n	Layer:         sha256:862a3e9af0aeffe79345b790bad31baaa61e9402b6e616bff17babed6b053b54\n\nCVE-2016-7568 (Medium)\n	Integer overflow in the gdImageWebpCtx function in gd_webp.c in the GD Graphics Library (aka libgd) through 2.2.3, a