n kadmind in MIT Kerberos 5 (aka krb5) before 1.13.4 and 1.14.x before 1.14.1 does not verify whether \'\\0\' characters exist as expected, which allows remote authenticated users to obtain sensitive information or cause a denial of service (out-of-bounds read) via a crafted string.\n\n	Package:       krb5 @ 1.12+dfsg-2ubuntu5.2\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2015-8629\n	Layer:         sha256:619b1ba840e1e06ba0c32fe720f12961bf54035350326cd5562513d741950ae2\n\nCVE-2016-3119 (Medium)\n	The process_db_args function in plugins/kdb/ldap/libkdb_ldap/ldap_principal2.c in the LDAP KDB module in kadmind in MIT Kerberos 5 (aka krb5) through 1.13.4 and 1.14.x through 1.14.1 mishandles the DB argument, which allows remote authenticated users to cause a denial of service (NULL pointer dereference and daemon crash) via a crafted request to modify a principal.\n\n	Package:       krb5 @ 1.12+dfsg-2ubuntu5.2\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-3119\n	Layer:         sha256:619b1ba840e1e06ba0c32fe720f12961bf54035350326cd5562513d741950ae2\n\nCVE-2015-0245 (Medium)\n	D-Bus 1.4.x through 1.6.x before 1.6.30, 1.8.x before 1.8.16, and 1.9.x before 1.9.10 does not validate the source of ActivationFailure signals, which allows local users to cause a denial of service (activation failure error returned) by leveraging a race condition involving sending an ActivationFailure signal before systemd responds.\n\n	Package:       dbus @ 1.6.18-0ubuntu4.3\n	Fixed version: 1.6.18-0ubuntu4.4\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2015-0245\n	Layer:         sha256:862a3e9af0aeffe79345b790bad31baaa61e9402b6e616bff17babed6b053b54\n\nCVE-2016-0494 (Medium)\n	Unspecified vulnerability in the Java SE and Java SE Embedded components in Oracle Java SE 6u105, 7u91, and 8u66 and Java SE Embedded 8u65 allows remote attackers to affect confidentiality, integrity, and availability via unknown vectors related to 2D.\n\