	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-9557\n	Layer:         sha256:80983e976c3c625a16b3d8457cc7afa8afb24c14ce6c30d598276bd036e55abf\n\nCVE-2016-9560 (Medium)\n	[stack-based buffer overflow in jpc_tsfb_getbands2 (jpc_tsfb.c)]\n\n	Package:       jasper @ 1.900.1-14ubuntu3.3\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-9560\n	Layer:         sha256:80983e976c3c625a16b3d8457cc7afa8afb24c14ce6c30d598276bd036e55abf\n\nCVE-2016-3120 (Medium)\n	The validate_as_request function in kdc_util.c in the Key Distribution Center (KDC) in MIT Kerberos 5 (aka krb5) before 1.13.6 and 1.4.x before 1.14.3, when restrict_anonymous_to_tgt is enabled, uses an incorrect client data structure, which allows remote authenticated users to cause a denial of service (NULL pointer dereference and daemon crash) via an S4U2Self request.\n\n	Package:       krb5 @ 1.12+dfsg-2ubuntu5.2\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-3120\n	Layer:         sha256:619b1ba840e1e06ba0c32fe720f12961bf54035350326cd5562513d741950ae2\n\nCVE-2016-8654 (Medium)\n	[Heap-based buffer overflow in QMFB code in JPC codec]\n\n	Package:       jasper @ 1.900.1-14ubuntu3.3\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-8654\n	Layer:         sha256:80983e976c3c625a16b3d8457cc7afa8afb24c14ce6c30d598276bd036e55abf\n\nCVE-2016-1585 (Medium)\n	mount rules grant excessive permissions\n\n	Package:       apparmor @ 2.8.95~2430-0ubuntu5.3\n	Link:          http://people.ubuntu.com/~ubuntu-security/cve/CVE-2016-1585\n	Layer:         sha256:80983e976c3c625a16b3d8457cc7afa8afb24c14ce6c30d598276bd036e55abf\n\nCVE-2015-5602 (Medium)\n	sudoedit in Sudo before 1.8.15 allows local users to gain privileges via a symlink attack on a file whose full path is defined using multiple wildcards in /etc/sudoers, as demonstrated by \"/home/*/*/file.txt.\"\n\n	Package:       sudo @ 1.8.9p5-1ubuntu1.2\n	Link:          http://people.ubuntu.com/~u